(1, 'Diploma in Medical Ultrasonography  (DMU)', 'PG Diploma (DMU)', 'The objective of this one-year duration PG Diploma course is to produce advanced standing Sonologist and/or Sonographers through a very intensive and more detail.', 'fa fa-book', '04', 1, 1, 'One Year Full-time & Distance Learning Program', 'DMU 101', 1, NULL, NULL, NULL, '<p><br></p><p>Key features:<br>•&nbsp;&nbsp;&nbsp; It is a Post Graduate Diploma course in Diagnostic Medical Ultrasound.<br>•&nbsp;&nbsp;&nbsp; It is a One-year regular full time course.<br>•&nbsp;&nbsp;&nbsp; It is also available as One-year distance learning program with 2 months at site hands-on training.&nbsp; <br>•&nbsp;&nbsp;&nbsp; It is a comprehensive course covering almost all ultrasound modalities with North American curriculum and scanning protocol for ARDMS registry exam.<br>•&nbsp;&nbsp;&nbsp; This program is intended for all medical doctors and allied health professionals who wish to perform General abdominal, small parts, Thyroid, Breasts and OBGYN Ultrasonography independently for diagnostic purposes in advance standing or tertiary level.<br>•&nbsp;&nbsp;&nbsp; One to One Hands-on training with state of the art training facility, modern ultrasound equipment, supplemented by videos, lectures &amp; American-Canadian licensed instructor.<br>•&nbsp;&nbsp;&nbsp; The distant learning program is intended only for those who are unable to attend in a regular program due to their pre-occupation and/or for foreign students who cannot afford one year leave from their employers.&nbsp; However, they must ready for 2-month full time at site hands-on training at the end. <br>Objective:<br>·&nbsp;&nbsp; The objective of this one-year duration PG-Diploma course is to produce advanced standing sonologist and sonographers through a very intensive and more detail course module comprising both didactic and hands on practical training that will be able to serve the community in a secondary or tertiary level hospitals or clinics.<br>&nbsp;<br>·&nbsp;&nbsp; To obtain RDMS credentials from USA. Our graduates after completion of their diploma courses, becomes eligible to sit for American licensing examination popularly known as ARDMS, who provides RDMS, RDCS, RVT, RMSK certificates, a globally recognized credentials in the field of ultrasound. Passing rate of our graduates in ARDMS examination is almost 100%, because our curriculum and hands on training follows the curriculum and scanning protocol of ARDMS and CARDUP (Sonography Canada).&nbsp; <br><br>Course Content:<br>&nbsp;<br>It is a comprehensive course covering all aspect of the AIUM, ARDMS &amp; CARDUP Guideline for scanning technique and protocol along with didactic course curriculum. The subjects taught within the one year DMU program are:<br>o&nbsp;&nbsp;&nbsp;&nbsp; Sonographic principles &amp; instrumentation (SPI),<br>o&nbsp;&nbsp;&nbsp;&nbsp; Abdominal ultrasound <br>o&nbsp;&nbsp;&nbsp;&nbsp; OBGYN ultrasound with Neurosonology<br>o&nbsp;&nbsp;&nbsp;&nbsp; Small parts and superficial structures ultrasound.<br>o&nbsp;&nbsp;&nbsp;&nbsp; Clinical practicum (hands-on) Part -I<br>o&nbsp;&nbsp;&nbsp;&nbsp; Clinical practicum (hands-on) Part - II <br><br>Course Content – Sonographic Principles &amp; Instrumentation: <br><br>o&nbsp;&nbsp;&nbsp;&nbsp; Introduction and Basic terminology <br>o&nbsp;&nbsp;&nbsp;&nbsp; Wave parameters –sound wave &amp; ultrasound wave parameters <br>o&nbsp;&nbsp;&nbsp;&nbsp; Interaction of ultrasound &amp; tissues<br>o&nbsp;&nbsp;&nbsp;&nbsp; TGC &amp; echo-ranging<br>o&nbsp;&nbsp;&nbsp;&nbsp; Ultrasound Transducer theories &amp; types <br>o&nbsp;&nbsp;&nbsp;&nbsp; Pulse-echo imaging &amp; instrumentation<br>o&nbsp;&nbsp;&nbsp;&nbsp; Display mode, image storage &amp; recording<br>o&nbsp;&nbsp;&nbsp;&nbsp; Hemodynamics<br>o&nbsp;&nbsp;&nbsp;&nbsp; Doppler principles &amp; Instrumentation<br>o&nbsp;&nbsp;&nbsp;&nbsp; Image artifacts in grey scale ultrasound &amp; <br>o&nbsp;&nbsp;&nbsp;&nbsp; Image artifacts in Doppler ultrasound<br>o&nbsp;&nbsp;&nbsp;&nbsp; Bioeffects and patient’s safety<br>o&nbsp;&nbsp;&nbsp;&nbsp; Quality assurance &amp; quality control<br>o&nbsp;&nbsp;&nbsp;&nbsp; New technologies &amp; Protocol<br>&nbsp;<br>Course Content – Abdominal Ultrasound: <br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Introduction, Terminology &amp; Image orientation<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Introduction, Basic Nomenclature, Terminology &amp; Image orientation<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Abdominal vasculature – arterial system<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Abdominal vasculature – Systemic &amp; Portal venous system<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Normal liver, anatomy and physiology<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Liver pathology<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Gall bladder and Biliary tree<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pancreas<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Spleen &amp; Reticuloendothelial system <br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Retroperitoneum <br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Adrenal glands<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Normal Kidney &amp; Lower urinary tract <br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kidney &amp; Lower urinary tract pathology<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Transplant Kidney<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Gastrointestinal tract<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Peritoneal cavities, fluid collections, ascites<br><br>Course Content – Small parts and superficial structure ultrasound <br><br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Neck, Thyroid &amp; Parathyroid gland<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Breast<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Prostate &amp; Seminal Vesicles<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Scrotum &amp; Testes<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Abdominal walls and Non-Cardiac chest.<br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Basic MSK – muscles, joints and ligaments. <br><br>Course content - Gynecology ultrasound: <br><br>o&nbsp;&nbsp;&nbsp;&nbsp; Introduction, basic terminology and Image Orientation<br>o&nbsp;&nbsp;&nbsp;&nbsp; Anatomy of female pelvis<br>o&nbsp;&nbsp;&nbsp;&nbsp; Physiology of female pelvis<br>o&nbsp;&nbsp;&nbsp;&nbsp; Uterine &amp; Vaginal pathology<br>o&nbsp;&nbsp;&nbsp;&nbsp; Ovarian and adnexal pathology <br>o&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; PID &amp; IUCD<br>o&nbsp;&nbsp;&nbsp;&nbsp; Infertility &amp; ART<br>o&nbsp;&nbsp;&nbsp;&nbsp; Patient care, safety and quality assurance <br>&nbsp;<br><br>Course content - OB-ultrasound: <br>&nbsp;<br>o&nbsp;&nbsp;&nbsp;&nbsp; Normal first trimester<br>o&nbsp;&nbsp;&nbsp;&nbsp; Early pregnancy failure <br>o&nbsp;&nbsp;&nbsp;&nbsp; Ectopic pregnancy<br>o&nbsp;&nbsp;&nbsp;&nbsp; GTD/GTN<br>o&nbsp;&nbsp;&nbsp;&nbsp; First Trimester anomaly screening at 11w-13W6days.<br>o&nbsp;&nbsp;&nbsp;&nbsp; Normal 2nd &amp; 3rd Trimester<br>o&nbsp;&nbsp;&nbsp;&nbsp; Extra Fetal assessment of Placenta, AF, Cervix, Uterus, Ovaries &amp; adnexa<br>o&nbsp;&nbsp;&nbsp;&nbsp; Fetal age, Growth assessment &amp; IUGR <br>o&nbsp;&nbsp;&nbsp;&nbsp; Multiple gestations<br>o&nbsp;&nbsp;&nbsp;&nbsp; Fetal anomaly of CNS, face &amp; neck<br>o&nbsp;&nbsp;&nbsp;&nbsp; Fetal heart – Normal heart &amp; cardiac anomaly<br>o&nbsp;&nbsp;&nbsp;&nbsp; Abdominal wall defects<br>o&nbsp;&nbsp;&nbsp;&nbsp; Gastrointestinal tract anomaly<br>o&nbsp;&nbsp;&nbsp;&nbsp; Genito-Urinary anomaly<br>o&nbsp;&nbsp;&nbsp;&nbsp; Skeletal anomaly<br>o&nbsp;&nbsp;&nbsp;&nbsp; Chromosomal anomaly (aneuploidy)<br>o&nbsp;&nbsp;&nbsp;&nbsp; Non-chromosomal anomaly (Structural &amp; developmental anomaly) <br>o&nbsp;&nbsp;&nbsp;&nbsp; Fetal hydrops, Diabetes, Hemolytic disease of new born <br>o&nbsp;&nbsp;&nbsp;&nbsp; Fetal surveillance by Doppler &amp; Biophysical profile<br>o&nbsp;&nbsp;&nbsp;&nbsp; Recording, Interpretation &amp; Report writing<br><br><br>Registration:<br>·&nbsp;&nbsp;&nbsp;&nbsp; Course starts twice in a year.&nbsp; Student can enroll for – <br>·&nbsp;&nbsp;&nbsp;&nbsp; Winter session: &nbsp;&nbsp;&nbsp; January-December&nbsp; or, <br>·&nbsp;&nbsp;&nbsp;&nbsp; Fall session:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; July-June. <br>&nbsp;<br>·&nbsp;&nbsp;&nbsp;&nbsp; Foreign students must apply at least three month ahead for visa processing. <br>Eligibility Criteria for Bangladeshi Residents:<br>·&nbsp;&nbsp;&nbsp;&nbsp; MBBS, MD or any equivalent degree in Medicine, recognized by BMDC. <br>Eligibility Criteria for Foreign Applicants or Non-Resident Bangladeshi: <br>·&nbsp;&nbsp;&nbsp;&nbsp; MBBS, MD or any equivalent degree in Medicine.<br>·&nbsp;&nbsp;&nbsp;&nbsp; Bachelor in Radiology Technology (RT)<br>·&nbsp;&nbsp;&nbsp;&nbsp; Bachelor in Medical Imaging Technology (BMIT)<br>·&nbsp;&nbsp;&nbsp;&nbsp; Bachelor in Physiotherapy <br>·&nbsp;&nbsp;&nbsp;&nbsp; Bachelor in Nuclear Medicine<br>·&nbsp;&nbsp;&nbsp;&nbsp; Bachelor of Nursing and/or Midwifery. <br>·&nbsp;&nbsp;&nbsp;&nbsp; Bachelor of Homeopathic Medicine (BHMS). <br><br>Course Duration:<br>·&nbsp;&nbsp;&nbsp;&nbsp; One Year for regular program. <br>·&nbsp;&nbsp;&nbsp;&nbsp; One Year for distance learning (can vary with individual student). <br>·&nbsp;&nbsp;&nbsp;&nbsp; In distance learning program, students can complete the course at their own pace and s/he must come on-site at our school at the end of the program for a minimum period of two (2) months for direct hands on training and final evaluation for certification. <br><br>International Students:<br>We welcome students from foreign countries to enrich our campus life and foster life<br>long relationships and international cultural interactions.<br><br>Foreign students must apply at least three months ahead for visa processing. <br>The certificates submitted by foreign students as prerequisite must be authorized<br>and/or recognized by their respective board, university and/or medical council. <br>Accommodation: we have limited access of accommodation facilities at this moment<br>for foreign students nearby the campus. However, it should be requested earlier to<br>avail a seat. Or if one wants to stay elsewhere, we may assist to find suitable<br>accommodation nearby.<br><br><br></p>', NULL, 180, 'The Diploma (DMU) shall be awarded by Bangladesh Technical Education Board (BTEB) for those who registers and successfully completes all the requirement of the program approved by BTEB.', 1, 1, 'This program is intended for all medical doctors and allied health professionals who wish to perform abdominal, small parts, Thyroid, Breasts and OBGYN sonography independently for diagnostic purposes in advance standing or tertiary level.', '1610789390.png', 'fa fa-book', 1, '2020-04-29 15:45:44', '2021-04-25 06:19:39');
