:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:Vrinda;\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><b><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-language:\r\nBN-BD\">Key features:</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;mso-list:l4 level1 lfo1;background:\r\nwhite\"><span style=\"font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">It is a post graduate diploma program\r\nin <b>OBGYN</b> Ultrasound.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;mso-list:l4 level1 lfo1;background:\r\nwhite\"><span style=\"font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">It is a <b>six-month</b>\r\ncomprehensive course on both <b>Transabdominal</b> and <b>Transvaginal OBGYN\r\nSonography</b>.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l4 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">This program will give you the\r\npractical and theoretical knowledge to perform and understand both\r\ntransabdominal and transvaginal pelvic examination, at your <b>\'Point of Care\'</b>\r\nwith AIUM Standard Protocol, including fetal structural and genetic anomaly\r\nscreening.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l4 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">One to One Hands-on training</span></b><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"> with state of the art training facility, modern ultrasound equipment,\r\nsupplemented by videos, lectures &amp; American-Canadian licensed instructor.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nbackground:white\"><span style=\"font-size:14.0pt;line-height:115%;font-family:\r\n&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\">Target group:</span><span style=\"font-size:13.0pt;line-height:115%;\r\nfont-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l4 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">This program is intended for <b>Gynecologist\r\n&amp; Obstetricians</b>, <b>OBGYN residents</b> &amp; <b>MRCOG candidates</b> and\r\nallied health professionals who wish to perform OBGYN Ultrasonography\r\nindependently for diagnostic purposes in advance standing or tertiary level.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l4 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">For <b>sonologist or sonographers</b>\r\nwho are looking to enhance their ability to identify female pelvic pathology\r\nand pregnancy screening at more advance or tertiary level including first\r\ntrimester and 2<sup>nd</sup> trimester fetal anomaly scan, Infertility\r\nscreening,<span style=\"mso-spacerun:yes\">&nbsp; </span>Fetal surveillance and IUGR\r\nassessment using Duplex Doppler imaging in both transabdominal and transvaginal\r\napproach. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l4 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">For those who wants to enhance or\r\nimprove their technique in both transabdominal and transvaginal scanning</span><span style=\"font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><b><span style=\"font-size:12.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-language:\r\nBN-BD\">Course Content:</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l2 level1 lfo2;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">It is a comprehensive course\r\ncovering all aspect of the AIUM, ARDMS &amp; CARDUP Guideline for scanning\r\ntechnique and protocol along with didactic course curriculum. The subjects\r\ntaught within the six month program are:</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;background:white\"><span style=\"font-size:7.0pt;font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:60.55pt;mso-add-space:auto;text-indent:-.25in;line-height:\r\nnormal;mso-list:l1 level1 lfo3;background:white\"><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:Candara;\r\nmso-bidi-font-family:Candara;letter-spacing:.75pt;mso-bidi-language:BN-BD;\r\nmso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">o<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\">Obstetrical<span style=\"mso-spacerun:yes\">&nbsp; </span>ultrasound</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:60.55pt;mso-add-space:auto;text-indent:-.25in;line-height:\r\nnormal;mso-list:l1 level1 lfo3;background:white\"><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:Candara;\r\nmso-bidi-font-family:Candara;letter-spacing:.75pt;mso-bidi-language:BN-BD;\r\nmso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">o<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\">Gynecological ultrasound</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:60.55pt;mso-add-space:auto;text-indent:-.25in;line-height:\r\nnormal;mso-list:l1 level1 lfo3;background:white\"><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:Candara;\r\nmso-bidi-font-family:Candara;letter-spacing:.75pt;mso-bidi-language:BN-BD;\r\nmso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">o<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\">Clinical practicum (hands-on) </span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:60.55pt;mso-add-space:auto;text-indent:-.25in;line-height:\r\nnormal;mso-list:l1 level1 lfo3;background:white\"><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:Candara;\r\nmso-bidi-font-family:Candara;letter-spacing:.75pt;mso-bidi-language:BN-BD;\r\nmso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">o<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\">Sonographic principles &amp; instrumentation (SPI)</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;background:white\"><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\"><br></span></b></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-mar