1;mso-bidi-language:BN-BD\">International\r\nStudents:</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l2 level1 lfo2;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:\r\nIgnore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">We welcome students from foreign\r\ncountries to enrich our campus life and foster life-long relationships and\r\ninternational cultural interactions.</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-align:justify;\r\ntext-indent:-.25in;line-height:normal;mso-outline-level:3;mso-list:l2 level1 lfo2;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;mso-bidi-language:\r\nBN-BD;mso-bidi-font-weight:bold;mso-bidi-font-style:italic\"></span><b><i><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-language:BN-BD\">Foreign students must apply at least three month ahead\r\nfor visa processing. </span></i></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;margin-bottom:\r\n0in;margin-bottom:.0001pt;mso-add-space:auto;text-align:justify;text-indent:\r\n-.25in;line-height:normal;mso-list:l2 level1 lfo2;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:\r\nIgnore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">Accommodation: we have limited\r\naccess of accommodation facilities at this moment for foreign students nearby\r\nthe campus. However, it should be requested earlier to avail a seat. Or if one\r\nwants to stay elsewhere, we may assist to find suitable accommodation nearby.</span></p>', NULL, 160, 'For sonologist or sonographers who are looking to enhance their ability to identify female pelvic pathology and pregnancy screening at more advance or tertiary level including first trimester and 2nd trimester fetal anomaly scan, Infertility screening,  Fetal surveillance and IUGR assessment using Duplex Doppler imaging in both transabdominal and transvaginal approach.', 2, 1, 'This program is intended for OBGYN specialists, OBGYN residents & MRCOG candidates and General Sonologists who wish to perform OBGYN Sonography independently for diagnostic purposes in advance standing or tertiary level.', '2.jpg', 'fa fa-book', 1, '2020-04-29 15:46:36', '2021-06-01 06:52:20');
