28;letter-spacing:.75pt;mso-bidi-language:BN-BD\">leading to<b>\r\nRMSKS (MSK). </b></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;background:white\"><b><span style=\"font-size:7.0pt;\r\nline-height:115%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l3 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">This program is intended for all medical doctors and\r\nallied health professionals who wish to take any of the above APCA/ARDMS licensing\r\nexamination and/or to obtain the credentials/Certificates in any of the specialty\r\nultrasound from Unites States of America. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;background:white\"><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l3 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">For beginners in ultrasound or no experience in\r\nultrasound at all, we suggest to take the first three basic subjects covering\r\nthe general ultrasound certificates requires in daily practice and also to\r\nobtain for the basic credentials in ultrasound. These are SPI, Abdomen and\r\nOBGYN ultrasound, essential for practicing general ultrasound. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;background:white\"><span style=\"font-size:7.0pt;line-height:115%;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l3 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">For further subspecialty courses any of the three\r\ndifferent combination or all the three can be taken:</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;background:white\"><span style=\"font-size:7.0pt;\r\nline-height:115%;font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:.75in;mso-add-space:auto;text-indent:-.25in;mso-list:l2 level1 lfo5;\r\nbackground:white\"><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:Candara;mso-bidi-font-family:Candara;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">RVT (VT) – SPI and Vascular Doppler Sonography.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:.75in;mso-add-space:auto;text-indent:-.25in;mso-list:l2 level1 lfo5;\r\nbackground:white\"><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:Candara;mso-bidi-font-family:Candara;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">RDCS (AE) – SPI and Adult Echocardiography.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:.75in;mso-add-space:auto;text-indent:-.25in;mso-list:l2 level1 lfo5;\r\nbackground:white\"><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:Candara;mso-bidi-font-family:Candara;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">3.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">RMSKS, RMSK – SPI and MSK ultrasound.<span style=\"mso-spacerun:yes\">&nbsp; </span></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:.75in;mso-add-space:auto;background:white\"><span style=\"font-size:7.0pt;line-height:115%;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l3 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">One to One Hands-on training with state of the art\r\ntraining facility, modern ultrasound equipment, supplemented by videos,\r\nlectures &amp; American-Canadian licensed instructor.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;background:white\"><span style=\"font-size:7.0pt;line-height:115%;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l3 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">After successful completion, necessary reference\r\nletter and Clinical verification form (CV-Form) will be provided to complete\r\nregistration process for ARDMS examination, from our institute signed by APCA/ARDMS\r\nlicensed instructor. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;background:white\"><span style=\"font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;mso-list:l3 level1 lfo1;background:\r\nwhite\"><span style=\"font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Physicians will register with </span><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-bidi-font-family:Arial;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;background:#FBFBF9\">The Alliance for\r\nPhysician Certification &amp; Advancement (APCA)</span><span style=\"font-family:\r\n&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;mso-themeshade:128;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">, or Allied health professional\r\nwill register with The American Diagnostic Medical Sonography (ARDMS) for the\r\nexamination.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;mso-list:l3 level1 lfo1;background:\r\nwhite\"><span style=\"font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">APCA/RDMS credentials are globally recognized\r\nultrasound certificate.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;mso-list:l3 level1 lfo1;background:\r\nwhite\"><span style=\"font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">APCA/ARDMS centers are available in different\r\ncountries worldwide.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;mso-list:l3 level1 lfo1;background:\r\nwhite\"><span style=\"font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Our center helps prospected candidates in preparing\r\nand enrolling for the examination online. </span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l3 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Passing rate of our graduates in ARDMS examination is\r\nalmost 100%, because our curriculum and hands on training follows the\r\ncurriculum and scanning protocol of AIUM, ARDMS and Sonography Canada (CARDUP).\r\n</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0in;margin-bottom:\r\n.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l3 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">We have many senior clinical instructors in our school\r\nhaving RDMS, RVT, RDCS and RMSK credentials. </span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom:0in;margin-bottom:.0001pt;\r\nmso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l3 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\">All the\r\nsubject modality in ultrasound we teaches at Shristy institute complies with\r\nthe curriculum and scanning protocol for ARDMS registry exam. </span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><b><span style=\"font-size:12.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\">Registration:</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-align:justify;\r\ntext-indent:-.25in;line-height:normal;mso-outline-level:3;mso-list:l7 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\">The\r\ncore subject SPI and basic ultrasound courses (Abdomen and OBGYN) starts twice\r\nin a year. <span style=\"mso-spacerun:yes\">&nbsp;</span><span style=\"letter-spacing:\r\n.75pt\">Student can enroll for – </span></span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-align:justify;\r\ntext-indent:-.25in;line-height:normal;mso-outline-level:3;mso-list:l7 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Winter session: <span style=\"mso-spacerun:yes\">&nbsp;</span>January-December</span></b><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\">, and for, </span><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;mso-bidi-language:BN-BD\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-align:justify;\r\ntext-indent:-.25in;line-height:normal;mso-outline-level:3;mso-list:l7 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Fall session:<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>July-June</span></b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">. </span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\"></span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-align:justify;\r\ntext-indent:-.25in;line-height:normal;mso-outline-level:3;mso-list:l7 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\">In\r\nVascular Doppler (RVT) and MSK ultrasound (RMSK) courses, student can enroll\r\nalmost every month. </span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-align:justify;\r\ntext-indent:-.25in;line-height:normal;mso-outline-level:3;mso-list:l7 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\"><span style=\"mso-spacerun:yes\">&nbsp;</span>Adult Echocardiography (RDCS) courses is a 4\r\nmonth course, enrollment occurs three times in a year, in January, May and\r\nSeptember of each year.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-align:justify;\r\ntext-indent:-.25in;line-height:normal;mso-outline-level:3;mso-list:l7 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\">We\r\ncan also arrange course at any time for individual groups, shortening the time\r\nperiod, upon discussion and based on background experience.<span style=\"mso-spacerun:yes\">&nbsp; </span><span style=\"mso-spacerun:yes\">&nbsp;</span></span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-align:justify;\r\ntext-indent:-.25in;line-height:normal;mso-outline-level:3;mso-list:l7 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD;mso-bidi-font-weight:\r\nbold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\">Contact\r\nwith our admission office for your special need.</span></b></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-align:justify;\r\ntext-indent:-.25in;line-height:normal;mso-outline-level:3;mso-list:l7 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#414498;\r\nmso-bidi-language:BN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#414498;mso-bidi-language:BN-BD\">Foreign students must apply at least\r\nthree month ahead for visa processing. </span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><b><span style=\"font-size:12.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;\r\nmso-bidi-language:BN-BD\">Eligibility criteria for Bangladeshi Residents:</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nline-height:normal;mso-outline-level:3;mso-list:l4 level1 lfo7;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:\r\n.75pt;mso-bidi-language:BN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">For SPI, Abdomen &amp; OBGYN credentials, MBBS, MD or any\r\nequivalent degree in Medicine, with or without back ground ultrasound experience.</span></b></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-outline-level:\r\n3;mso-list:l1 level1 lfo2;background:white\"><span style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#0F243E;mso-themecolor:text2;mso-themeshade:\r\n128;mso-bidi-language:BN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:\r\nIgnore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">For Vascular (RVT) and MSK (RMSK), prerequisite is\r\ndiploma in medical ultrasound with Sonographic principles and Instrumentation\r\n(SPI).</span></b><b><span style=\"font-size:12.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\"></span></b></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-outline-level:\r\n3;mso-list:l1 level1 lfo2;background:white\"><span style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#0F243E;mso-themecolor:text2;mso-themeshade:\r\n128;mso-bidi-language:BN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:\r\nIgnore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Vascular or Cardiovascular surgeons can also apply for\r\nRVT &amp; RDCS.</span></b><b><span style=\"font-size:12.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;mso-bidi-language:BN-BD\"></span></b></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-outline-level:\r\n3;mso-list:l1 level1 lfo2;background:white\"><span style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#0F243E;mso-themecolor:text2;mso-themeshade:\r\n128;mso-bidi-language:BN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:\r\nIgnore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Orthopedic Surgeon, Rheumatologist and Physiotherapy\r\nspecialist can apply for RMSK/RMSKS. </span></b><b><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-languag