=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">The certificates submitted by foreign students as prerequisite\r\nmust be authorized and/or recognized by their respective board, university\r\nand/or medical council. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;margin-bottom:\r\n0in;margin-bottom:.0001pt;mso-add-space:auto;text-align:justify;text-indent:\r\n-.25in;mso-list:l1 level1 lfo2;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:\r\n.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Accommodation: we have limited access of accommodation\r\nfacilities at this moment for foreign students nearby the campus. However, it\r\nshould be requested earlier to avail a seat. Or if one wants to stay elsewhere,\r\nwe may assist to find suitable accommodation nearby.</span></p>', NULL, 165, 'This program is intended for all medical doctors and allied health professionals who wish to take any of the above APCA/ARDMS licensing examination and/or to obtain the credentials/Certificates in any of the specialty ultrasound from Unites States of America.', 3, 1, 'It is intended for all medical doctors & allied health professionals who wish to take APCA-ARDMS licensing exam  and/or to obtain the credentials or Certificates in any of the specialty ultrasound from USA', '3.jpg', 'fa fa-book', 1, '2020-04-29 16:17:54', '2021-06-01 06:52:38');
