&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;\r\nmso-bidi-language:BN-BD\">Key features:</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l4 level1 lfo5;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Advance diploma in Medical Ultrasonography is a more\r\nadvance course in a short period of time.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l4 level1 lfo5;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">It is a three weeks full time very intensive hands-on\r\ntraining program with few didactic lectures.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l4 level1 lfo5;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">It covers extensive hands-on in all ultrasound\r\nspecialties including abdomen, Small parts, thyroid, Neck, Breasts, OBGYN\r\nultrasound with TVS/TAS approach, Sonohysterography, Neurosonology, Vascular\r\nDoppler sonography of OBGYN, Carotid &amp; peripheral vessels, abdominal\r\nvessels and Musculoskeletal ultrasound covering all the major joints, muscles,\r\nligaments. </span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l4 level1 lfo5;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">The course is conducted by a visiting highly\r\nexperienced Canadian-American Physician Sonographer Dr. Hugh Anthony Ellis and\r\ncertificate will be given from a Canadian Institute of Ultrasound Technique. </span></b><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\"></span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l4 level1 lfo5;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\"><span style=\"mso-spacerun:yes\">&nbsp;</span>One to One\r\nHands-on training</span></b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\"> with state of the art training facility, modern\r\nultrasound equipment, supplemented by videos, lectures &amp; Canadian-American licensed\r\ninstructor.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nbackground:white\"><span style=\"font-size:14.0pt;line-height:115%;font-family:\r\n&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\">Target group:</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l4 level1 lfo5;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">This program is intended for all practicing physician\r\nSonologists who wants to enhance or improve their technique in all ultrasound\r\nmodalities including Vascular Doppler sonography and MSK ultrasound. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l4 level1 lfo5;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">It is also intended for those who want to learn\r\nVascular Doppler sonography and MSK ultrasound for the first time under the\r\nsupervision of a North American Clinical instructor in ultrasound with 30 years\r\nexperience in teaching sonography. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l4 level1 lfo5;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Hands-on Training will also be provided in both\r\ntransabdominal and transvaginal scanning and Sonohysterography. </span></p><br><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><b><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;\r\nmso-bidi-language:BN-BD\">Registration:</span></b><b><span style=\"font-size:\r\n12.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;mso-bidi-language:BN-BD\"></span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nmso-outline-level:3;mso-list:l5 level1 lfo1;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-language:BN-BD\">This course is conducted only once in a year upon\r\navailability of visiting Canadian-American Clinical instructor DR. Hugh Anthony\r\nEllis. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nmso-outline-level:3;mso-list:l5 level1 lfo1;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">Student can enroll\r\nfor their name in the list with our admin officer, who will contact with\r\nprospected student(s) on time.</span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-language:BN-BD\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nmso-outline-level:3;mso-list:l5 level1 lfo1;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">Usually the course\r\nis being operated anytime between November to January of every year.</span><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-language:BN-BD\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nmso-outline-level:3;mso-list:l5 level1 lfo1;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#414498;mso-bidi-language:BN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#414498;mso-bidi-language:BN-BD\">Foreign students must apply at least\r\nthree month ahead for visa processing. </span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nmso-outline-level:3;mso-list:l5 level1 lfo1;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#414498;mso-bidi-language:BN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#414498;mso-bidi-language:BN-BD\">All students are encouraged to confirm\r\ntheir registration at least two-three ahead of time. </span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><b><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;\r\nmso-bidi-language:BN-BD\">Course Duration:</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;margin-bottom:\r\n0in;margin-bottom:.0001pt;mso-add-space:auto;text-indent:-.25in;line-height:\r\nnormal;mso-list:l0 level1 lfo2;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:\r\n.75pt;mso-bidi-language:BN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Three month (21 days) regular full time program </span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;margin-bottom:\r\n0in;margin-bottom:.0001pt;mso-add-space:auto;line-height:normal;background:\r\nwhite\"><b><span style=\"font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#4A4949;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><b><span style=\"font-size:13.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;\r\nmso-bidi-language:BN-BD\">Eligibility criteria:</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:12.0pt;margin-right:0in;\r\nmargin-bottom:12.0pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nline-height:normal;mso-outline-level:3;mso-list:l0 level1 lfo2;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:\r\n.75pt;mso-bidi-language:BN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Practicing Sonologist with MBBS, MD or any equivalent\r\ndegree in Medicine, or allied health professionals with previous diploma in\r\nmedical ultrasound.</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;line-height:normal;background:white\"><b><span style=\"font-size:7.0pt;font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l2 level1 lfo3;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\">Sonologist/Sonographers\r\nwith at least one year practical experience in practicing general ultrasound. </span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\"><b><span style=\"font-size:7.0pt;line-height:\r\n115%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l2 level1 lfo3;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Foreign students with above criteria can also apply. </span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><b><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;\r\nmso-bidi-language:BN-BD\">Course Content:</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l2 level1 lfo3;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">It is a comprehensive course covering all aspect of\r\nthe AIUM, ARDMS &amp; CARDUP Guideline for scanning technique and protocol.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l2 level1 lfo3;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F243E;\r\nmso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">One-to-One Hands training will be given on all the\r\nultrasound modalities at a tertiary level on the following subjects: </span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:60.55pt;mso-add-space:auto;text-indent:-.25in;mso-list:l1 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:&quot;Courier New&quot;;\r\nmso-fareast-font-family:&quot;Courier New&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">o<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Sonographic instrumentation or Knobology (SPI),</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:60.55pt;mso-add-space:auto;text-indent:-.25in;mso-list:l1 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:&quot;Courier New&quot;;\r\nmso-fareast-font-family:&quot;Courier New&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">o<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Abdominal ultrasound</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:60.55pt;mso-add-space:auto;text-indent:-.25in;mso-list:l1 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:&quot;Courier New&quot;;\r\nmso-fareast-font-family:&quot;Courier New&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">o<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-fa