n></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">MSK ultrasound </span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal;background:white\"><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-language:BN-BD\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun:yes\">&nbsp;</span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal;background:white\"><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-language:BN-BD\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-bottom:0in;margin-bottom:\r\n.0001pt;line-height:normal;background:white\"><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#17365D;mso-themecolor:text2;\r\nmso-themeshade:191;mso-bidi-language:BN-BD\">Certification:</span><span style=\"font-size:10.0pt;font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#17365D;\r\nmso-themecolor:text2;mso-themeshade:191;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"></span></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"mso-margin-top-alt:auto;margin-bottom:0in;\r\nmargin-bottom:.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;\r\nline-height:normal;mso-list:l3 level1 lfo6;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:\r\n.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\">A&nbsp;<b>“Certificate\r\nof Advance Diploma in Medical Sonography”</b>&nbsp;shall be awarded to the\r\nparticipants signed jointly by head of Shristy Institute and Institute of\r\nUltrasound Technique, Canada, who registers and successfully completes all the\r\nrequirement of the program.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><span style=\"font-size:12.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;\r\nmso-bidi-language:BN-BD\">International Student:</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l3 level1 lfo6;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:\r\n.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\">We welcome\r\nstudents from other countries to enrich our campus life and foster lifelong\r\nrelationships and international cultural interactions.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l3 level1 lfo6;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:\r\n.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#0F243E;mso-themecolor:text2;\r\nmso-themeshade:128;letter-spacing:.75pt;mso-bidi-language:BN-BD\">We don’t have\r\naccommodation facilities at the moment for foreign students. However, if\r\nrequested earlier, we may assist to find suitable accommodation nearby the\r\ncampus.</span></p>\r\n\r\n\r\n\r\n<span style=\"font-size:11.0pt;line-height:115%;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0F243E;mso-themecolor:text2;mso-themeshade:128;letter-spacing:.75pt;\r\nmso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:BN-BD\">International\r\nstudents must apply at least three month earlier for visa processing. </span>', NULL, 135, 'This program is intended for all practicing physician Sonologists who wants to enhance or improve their technique in all ultrasound modalities including Vascular Doppler sonography and MSK ultrasound.', 4, 1, 'This program is intended for all practicing Sonologists who wants to enhance or improve their technique in all ultrasound modalities including Vascular Doppler Sonography & MSK ultrasound', '1610789332.png', 'fa fa-book', 1, '2020-04-29 16:18:21', '2021-06-01 06:52:48');
