0in;line-height:normal;mso-outline-level:3;background:white\"><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#002060;\r\nmso-bidi-language:BN-BD\">Key features:</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l1 level1 lfo1;background:white\"><span style=\"font-size:10.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">It is a one month comprehensive\r\nultrasound course in vascular Doppler sonography.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l1 level1 lfo1;background:white\"><span style=\"font-size:10.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:10.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">The course\r\ncomprises of basic principles of Doppler physics with application and\r\nevaluation of Color Doppler, PW Doppler, CW Doppler and Power Doppler for all\r\nneck vessels, upper and lower limb vessels, abdominal arteries, veins, portal\r\nveins and their major branches, tributaries, and also fetal assessment by\r\nDoppler in OBGYN Ultrasound.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l1 level1 lfo1;background:white\"><span style=\"font-size:10.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">Vascular Ultrasound\r\ncourses are delivered with a main focus on the acquisition of basic practical\r\nskills on scanning techniques and protocols with AIUM/ARDMS standard protocol.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l1 level1 lfo1;background:white\"><span style=\"font-size:10.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">With Vascular\r\nultrasound, now a central component for Vascular disease assessment, this\r\ncourse will give you the practical and theoretical knowledge to perform and\r\nunderstand ultrasound examination in Carotid Doppler, Peripheral Arterial\r\nDoppler, Venous Doppler for assessment of DVT, Abdominal vessels Doppler\r\nspecially Renal Artery Doppler assessment and also Doppler study in Obstetrics,\r\nspecially Fetal Doppler for assessment of Placental insufficiency, fetal\r\nhypoxia, Preeclampsia &amp; IUGR.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l1 level1 lfo1;background:white\"><span style=\"font-size:10.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-size:10.0pt;font-family:\r\n&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">One\r\nto One Hands-on training&nbsp;</span></b><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#4A4949;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">is the main focus on practical skills acquisition with\r\npractical and didactic classes with instructor-student ratios of 1:4.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l1 level1 lfo1;background:white\"><span style=\"font-size:10.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">State of the art\r\ntraining facility with modern ultrasound equipment ranging from basic machine\r\nto High Resolution Color Doppler, PW/CW Doppler and Power Doppler along with\r\n3D/4D facilities.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><span style=\"font-size:12.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;\r\nmso-bidi-language:BN-BD\"><span style=\"mso-spacerun:yes\">&nbsp;</span></span><span style=\"font-size:12.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#17365D;\r\nmso-themecolor:text2;mso-themeshade:191;mso-bidi-language:BN-BD\">Target group</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;mso-list:l9 level1 lfo2;background:\r\nwhite\"><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">Are you a\r\nSonologist looking to develop your <b>Vascular ultrasound</b> skills?</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;mso-list:l9 level1 lfo2;background:\r\nwhite\"><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">Are you regularly\r\ncalled on to perform Vascular Assessment?</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;mso-list:l9 level1 lfo2;background:\r\nwhite\"><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">Are you a Vascular\r\nSurgeon looking to learn Vascular Doppler ultrasound for vascular disease assessment?</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;mso-list:l9 level1 lfo2;background:\r\nwhite\"><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">Are you a\r\nObstetrician, wants to learn application of Doppler in Obstetrics?</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;mso-list:l9 level1 lfo2;background:\r\nwhite\"><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&n