&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#17365D;\r\nmso-themecolor:text2;mso-themeshade:191;mso-bidi-language:BN-BD\">Certification:</span><span style=\"font-size:10.0pt;font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\"></span></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"mso-margin-top-alt:auto;margin-bottom:0in;\r\nmargin-bottom:.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;\r\nline-height:normal;mso-list:l6 level1 lfo10;background:white\"><span style=\"font-size:10.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">A&nbsp;<b>“Certificate\r\nof Achievement”</b>&nbsp;shall be awarded to the participants who registers and\r\nsuccessfully completes all the requirement of the program.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><span style=\"font-size:12.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;\r\nmso-bidi-language:BN-BD\">International Student:</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l6 level1 lfo10;\r\nbackground:white\"><span style=\"font-size:10.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">We welcome students\r\nfrom other countries to enrich our campus life and foster lifelong\r\nrelationships and international cultural interactions.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l6 level1 lfo10;\r\nbackground:white\"><span style=\"font-size:10.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">We don’t have\r\naccommodation facilities at the moment for foreign students. However, if\r\nrequested earlier, we may assist to find suitable accommodation nearby the\r\ncampus.</span></p>\r\n\r\n\r\n\r\n<span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:BN-BD\">International students must apply at least three\r\nmonth earlier for visa processing. </span>', NULL, 165, 'This program will also give you the practical and theoretical knowledge to perform and understand transabdominal & transvaginal pelvic examination, at your “point of care” for gynecological problems.', 5, 1, 'Doppler Sonography became a fundamental component of ultrasound practice for all. This program will give you the practical & theoretical knowledge to perform & understand Vascular Doppler assessment with a set of new skills ready', '2.jpg', 'fa fa-book', 1, '2020-04-29 16:27:48', '2021-06-01 06:52:55');
