ls on\r\nscanning techniques and protocols with ACS/ARDMS standard protocol covering the\r\nsyllabus for RDCS licensing examination.</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l6 level1 lfo2;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;color:#4A4949;letter-spacing:.75pt\">This\r\nspecialized course will give you practical proficiency in attaining advanced\r\nechocardiography views, with plenty of opportunity to apply these skills\r\nthrough our practical exercises.</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l6 level1 lfo2;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;color:#4A4949;letter-spacing:.75pt\">One\r\nto One Hands-on training is the main focus on practical skills acquisition with\r\npractical and didactic classes with instructor-student of 1:5 ratios.</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l6 level1 lfo2;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;color:#4A4949;letter-spacing:.75pt\">State\r\nof the art training facility with modern ultrasound equipment ranging from\r\nbasic machine to High Resolution Color Doppler, PW/CW Doppler and Power Doppler\r\nalong with Tissue Doppler Imaging (TDI) facilities. The utilization of real\r\npatient supplemented by videos, slides, lectures etc.</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l6 level1 lfo2;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;color:#4A4949;letter-spacing:.75pt\">Time-frame\r\ncan be modified from four month according to the participant’s special needs.</span></b></p>\r\n\r\n<h3 style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:12.0pt;margin-left:\r\n0in;line-height:normal;mso-pagination:widow-orphan;page-break-after:auto;\r\nbackground:white\"><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;\r\ncolor:#414498;font-weight:normal\">Target group:</span></h3>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l2 level1 lfo3;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\ncolor:#4A4949;letter-spacing:.75pt\">Are you a Cardiologist, Physician or\r\nInternist, wants to gain practical proficiency in performing and interpreting\r\ncardiac ultrasound scans?</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l2 level1 lfo3;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\ncolor:#4A4949;letter-spacing:.75pt\">Are you a Sonologist looking to develop\r\nyour Cardiac ultrasound skills?</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l2 level1 lfo3;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\ncolor:#4A4949;letter-spacing:.75pt\">Are you seeking to utilize cardiac\r\nultrasound for assessment of valvular disease?</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l2 level1 lfo3;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\ncolor:#4A4949;letter-spacing:.75pt\">Do you want to apply Cardiac ultrasound in\r\na critical arrest scenario?</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l2 level1 lfo3;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\ncolor:#4A4949;letter-spacing:.75pt\">Do you simply want to improve, refresh or\r\nextend your ultrasound technique and thus opening a new horizon of ultrasound\r\npractice?</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;mso-list:l2 level1 lfo3;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\ncolor:#4A4949;letter-spacing:.75pt\">Do you intend to appear RDCS licensing\r\nexamination in Adult echocardiography?</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nmargin-left:1.0in;line-height:normal;background:white\"><b><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;color:#C00000;\r\nletter-spacing:.75pt\">“THEN THIS IS THE RIGHT COURSE FOR YOU</span></b><b><span style=\"font-size:14.0pt;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-hansi-theme-font:major-latin;color:#4A4949;letter-spacing:.75pt\">”</span></b><span style=\"font-size:14.0pt;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-hansi-theme-font:major-latin;color:#4A4949;letter-spacing:.75pt\"></span></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"mso-margin-top-alt:auto;margin-bottom:0in;\r\nmargin-bottom:.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;\r\nmso-list:l3 level1 lfo4;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#4A4949;letter-spacing:.75pt\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;color:#4A4949;letter-spacing:.75pt\">This\r\nprogram will give you the practical and theoretical knowledge to perform and understand\r\nCardiac assessment with a set of new skills ready to apply in the real world.</span> <br></p><h3 style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:12.0pt;margin-left:\r\n0in;line-height:normal;mso-pagination:widow-orphan;page-break-after:auto;\r\nbackground:white\"><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;\r\ncolor:#414498;font-weight:normal\">Course Objective_Course Content:</span></h3>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-.25in;mso-list:l3 level1 lfo4;\r\nbackground:white\"><span style=\"font-size:11.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-size:11.0pt;font-family:\r\n&quot;Candara&quot;,sans-serif;color:#4A4949;letter-spacing:.75pt\">This practical and\r\nfocused course builds your skills in a practical, step-by-step manner with\r\nsupervised hands-on scanning. </span></b></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;text-align:justify;background:white\"><b><span style=\"font-size:7.0pt;font-family:&quot;Candara&quot;,sans-serif;color:#4A4949;\r\nletter-spacing:.75pt\">&nbsp;</span></b></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;\r\nmargin-bottom:.0001pt;text-align:justify;text-indent:-.25in;mso-list:l3 level1 lfo4;\r\nbackground:white\"><span style=\"font-size:11.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-size:11.0pt;font-family:\r\n&quot;Candara&quot;,sans-serif;color:#4A4949;letter-spacing:.75pt\">At the conclusion of\r\nthis course you will be able to:</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:53.5pt;mso-add-space:auto;text-indent:-.25in;line-height:normal;\r\nmso-list:l4 level1 lfo5;background:white\"><span style=\"font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\nCambria;mso-fareast-theme-font:major-latin;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:Cambria;mso-bidi-theme-font:major-latin;co