tyle=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\ncolor:#4A4949;letter-spacing:.75pt\">January, May and September of each year. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;margin-bottom:\r\n0in;margin-bottom:.0001pt;mso-add-space:auto;text-indent:-.25in;line-height:\r\nnormal;mso-list:l7 level1 lfo8;background:white\"><span style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#4A4949;letter-spacing:.75pt\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\ncolor:#4A4949;letter-spacing:.75pt\">Can start on demand anytime with minimum\r\n4-5 students. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;margin-bottom:\r\n0in;margin-bottom:.0001pt;mso-add-space:auto;text-indent:-.25in;line-height:\r\nnormal;mso-list:l7 level1 lfo8;background:white\"><span style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#4A4949;letter-spacing:.75pt\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\ncolor:#4A4949;letter-spacing:.75pt\">Must be upon your confirmation of\r\nadmission.</span></p>\r\n\r\n<h3 style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:12.0pt;margin-left:\r\n0in;line-height:normal;mso-pagination:widow-orphan;page-break-after:auto;\r\nbackground:white\"><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;\r\ncolor:#414498;font-weight:normal\">Certification:</span></h3>\r\n\r\n<p class=\"MsoListParagraph\" style=\"mso-margin-top-alt:auto;margin-bottom:0in;\r\nmargin-bottom:.0001pt;mso-add-space:auto;text-align:justify;text-indent:-.25in;\r\nline-height:normal;mso-list:l5 level1 lfo9;background:white\"><span style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#4A4949;letter-spacing:.75pt\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\ncolor:#4A4949;letter-spacing:.75pt\">A&nbsp;<b>“Certificate of Achievement”</b>&nbsp;shall\r\nbe awarded to the participants who registers and successfully completes all the\r\nrequirement of the program.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><b><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#17365D;\r\nmso-themecolor:text2;mso-themeshade:191;mso-bidi-language:BN-BD\">International\r\nStudents:</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l8 level1 lfo1;background:white\"><span style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">We welcome students\r\nfrom other countries to enrich our campus life and foster life-long\r\nrelationships and international cultural interactions.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l8 level1 lfo1;background:white\"><span style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">We don’t have\r\naccommodation facilities at the moment for foreign students. However, if\r\nrequested earlier, we may assist to find suitable accommodation nearby the\r\ncampus.</span></p>', NULL, 140, 'This program will also demonstrate the techniques of Doppler assessment of Fetal-maternal circulation, fetal wellbeing and IUGR and Biophysical profile.  who wants to emigrate to USA, Canada or elsewhere and starts.', 6, 1, 'This course is intended for Cardiologist, Cardio-vascular surgeons, Internal medicine specialist and Sonologists. This program will give you the practical & theoretical knowledge to perform and understand Cardiac assessment with a set of new skills ready to apply in the real world.', '3.jpg', 'fa fa-book', 1, '2020-04-29 16:28:42', '2021-06-01 06:53:03');
