ine-height:normal;mso-outline-level:3;background:white\"><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;\r\nmso-bidi-language:BN-BD\">Key features:</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#4A4949;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Fetal Anomaly Scan is a one month Advanced Obstetrics\r\nultrasound course for Pregnancy Assessment.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#4A4949;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">This Advanced Ultrasound for Pregnancy Assessment\r\ncourses are delivered with a main focus on the acquisition of extended\r\npractical skills on scanning techniques and protocols to identify/exclude fetal\r\nanomaly including Chromosomal or aneuploidy scan.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#4A4949;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">This course will give you the practical and\r\ntheoretical knowledge to perform and understand ultrasound examination in\r\npregnancy with emphasis on ability of identifying&nbsp;<b>fetal anomalies,\r\nincluding sonographic soft-markers for genetic abnormalities.</b></span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#4A4949;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">This program will also demonstrate the techniques\r\nof&nbsp;<b>Doppler assessment&nbsp;</b>of Fetal-maternal circulation, fetal\r\nwellbeing and IUGR and Biophysical profile.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#4A4949;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">One to One Hands-on training&nbsp;</span></b><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#4A4949;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">is the main focus on practical skills acquisition with\r\npractical and didactic classes with instructor-student of 1:5 ratios.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l0 level1 lfo4;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;