49;letter-spacing:.75pt;mso-bidi-language:BN-BD\">Surveillance of preeclampsia,\r\ngestational diabetes, IUGR, fetal hypoxia.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nmargin-left:53.5pt;text-indent:-.25in;mso-list:l1 level2 lfo2;tab-stops:list 53.5pt;\r\nbackground:white\"><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:Candara;mso-bidi-font-family:Candara;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">o<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">Discuss the\r\nclinical role, practical applications, and limitations of ultrasound in the\r\nassessment of pregnancy.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-bottom:0in;margin-left:\r\n53.5pt;margin-bottom:.0001pt;text-indent:-.25in;mso-list:l1 level2 lfo2;\r\ntab-stops:list 53.5pt;background:white\"><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:Candara;\r\nmso-bidi-font-family:Candara;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">o<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#4A4949;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">Document and present complete and accurate sonographic\r\nfindings for recording and reporting to facilitate appropriate diagnosis and\r\nmanagement.</span></p>\r\n\r\n<