:normal;mso-outline-level:3;background:white\"><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;\r\nmso-bidi-language:BN-BD\">Certification:</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-bottom:0in;margin-left:\r\n53.5pt;margin-bottom:.0001pt;text-indent:-.25in;line-height:normal;mso-list:\r\nl3 level2 lfo1;tab-stops:list 53.5pt;background:white\"><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:Candara;\r\nmso-bidi-font-family:Candara;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">o<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#4A4949;letter-spacing:.75pt;\r\nmso-bidi-language:BN-BD\">A&nbsp;<b>“Certificate of Achievement”</b>&nbsp;shall\r\nbe awarded to the participants who registers and successfully completes all the\r\nrequirement of the program.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;\r\nmso-bidi-language:BN-BD\">International Student:</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l2 level1 lfo3;\r\nbackground:white\"><span style=\"font-size:12.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">We welcome students\r\nfrom other countries to enrich our campus life and foster life-long\r\nrelationships and international cultural interactions.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l2 level1 lfo3;\r\nbackground:white\"><span style=\"font-size:12.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">We don’t have\r\naccommodation facilities at the moment for foreign students. However, if\r\nrequested earlier, we may assist to find suitable accommodation nearby the\r\ncampus.</span></p>', NULL, 162, 'Fetal anomaly screening is a fundamental component with OB ultrasound. This course will give you the practical and didactic skill to perform fetal anomaly and genetic screening in first trimester, 2nd & 3rd trimester including fetal surveillance by Doppler for abnormal growth assessment…', 7, 1, 'Are you sonologist, Radiologist, Obstetrician or OBGYN residents, or Fetal-medicine specialist, looking to develop your ultrasound skills to identify fetal anomalies, Genetic or Aneuploidy screening? Then this is the right course for you.', '1598179150.png', 'fa fa-book', 1, '2020-04-29 16:29:15', '2021-06-01 06:53:14');
