acing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">One to One Hands-on\r\ntraining</span></b><span style=\"font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">&nbsp;is the main focus on\r\npractical skills acquisition with practical and didactic classes with instructor-student\r\nratios of 1:4.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;margin-bottom:\r\n0in;margin-bottom:.0001pt;mso-add-space:auto;text-align:justify;line-height:\r\nnormal;background:white\"><span style=\"font-size:7.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"mso-margin-top-alt:auto;margin-bottom:\r\n0in;margin-bottom:.0001pt;mso-add-space:auto;text-align:justify;text-indent:\r\n-.25in;line-height:normal;mso-list:l5 level1 lfo2;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;