ave\r\naccommodation facilities at the moment for foreign students. However, if\r\nrequested earlier, we may assist to find suitable accommodation nearby the\r\ncampus.</span></p>\r\n\r\n</p>', NULL, 170, 'This program will also demonstrate the techniques of Doppler assessment of Fetal-maternal circulation, fetal wellbeing and IUGR and Biophysical profile.  who wants to emigrate to USA, Canada or elsewhere and starts.', 8, 1, 'Are you a Sonologist, Gynecologist, OBGYN residents, wants to advance your carrier in transvaginal sonography which will enhance your diagnostic ability in OBGYN problems? Then this is the right course for you.', '2.jpg', 'fa fa-book', 1, '2020-04-29 16:34:09', '2021-06-01 06:53:20');
