ccent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin-top:0in;\r\n	mso-para-margin-right:0in;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0in;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:Vrinda;\r\n	mso-bidi-theme-font:minor-bidi;}\r\ntable.MsoTableGrid\r\n	{mso-style-name:\"Table Grid\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-priority:59;\r\n	mso-style-unhide:no;\r\n	border:solid black 1.0pt;\r\n	mso-border-themecolor:text1;\r\n	mso-border-alt:solid black .5pt;\r\n	mso-border-themecolor:text1;\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-border-insideh:.5pt solid black;\r\n	mso-border-insideh-themecolor:text1;\r\n	mso-border-insidev:.5pt solid black;\r\n	mso-border-insidev-themecolor:text1;\r\n	mso-para-margin:0in;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:\"Times New Roman\";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:Vrinda;\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><b><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#7030A0;\r\nmso-bidi-language:BN-BD\">Key features:</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-align:justify;text-indent:-.25in;\r\nmso-list:l1 level1 lfo4\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\">After completion of the MSK ultrasound course, the\r\nprofessional is capable of using MSK ultrasound in their day to day clinical\r\npractice in a qualitative and critical way. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align:justify;text-indent:-.25in;\r\nmso-list:l1 level1 lfo4\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\">The professionals will learn how to scan anatomical\r\nstructures of the upper limb and lower limb muscles, joints, ligaments and\r\nnerves. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align:justify;text-indent:-.25in;\r\nmso-list:l1 level1 lfo4\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\">They also will learn other superficial structures\r\nsuch as abdominal wall musculature and FAST protocol (Focused assessment by\r\nSonography in Trauma) to be able to identify any fluid or blood collection\r\nwithin the potential intra-thoracic, abdominal and pelvic cavities. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify;text-indent:-.25in;\r\nmso-list:l1 level1 lfo4\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\">The core of this hands-on skills course is based on\r\nan intensive review of anatomy of specific region, pathophysiology of common\r\nconditions within these regions and evidence based reviews of the use of MSK\r\nultrasound in the assessment of the locomotor system of human body. </span></p>\r\n\r\n\r\n\r\n<h4 style=\"margin-top:0in;text-align:justify;line-height:normal;background:\r\nwhite;mso-background-themecolor:background1\"><span style=\"font-size:14.0pt;\r\nfont-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#7030A0;mso-bidi-language:BN-BD;\r\nfont-style:normal\">What you\'ll learn?</span></h4>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:35.7pt;margin-bottom:.0001pt;mso-add-space:auto;\r\nline-height:normal;background:white\"><span style=\"font-size:7.0pt;font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:35.7pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-indent:-17.85pt;mso-list:l3 level1 lfo1;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">Standardized scanning protocol set by\r\nInternational MSK society. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:35.7pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-indent:-17.85pt;mso-list:l3 level1 lfo1;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">Will be able to scan all upper and\r\nlower extremity joint structures.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:35.7pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-indent:-17.85pt;mso-list:l3 level1 lfo1;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">Detailed sonographic anatomy of\r\nmusculoskeletal system. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:35.7pt;margin-bottom:.0001pt;text-indent:-17.85pt;mso-list:l3 level1 lfo1;\r\nbackground:white\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">Learning how to analyze and describe\r\nclinical cases.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:35.7pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-indent:-17.85pt;mso-list:l3 level1 lfo1;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">Interpretation of common\r\npathophysiology of muscles, joints and tendons. </span><span style=\"font-family:\r\n&quot;Candara&quot;,sans-serif;mso-bidi-font-family:Arial\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:35.7pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-indent:-17.85pt;mso-list:l3 level1 lfo1;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\">This course aims to learn how to differentiate\r\nnormal and abnormal MSK ultrasound findings. Based on clinical case approach,\r\nwe will discuss how to recognize the main features of pathological changes in\r\nmusculoskeletal structures. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0in;margin-right:0in;\r\nmargin-bottom:0in;margin-left:35.7pt;margin-bottom:.0001pt;mso-add-space:auto;\r\ntext-indent:-17.85pt;mso-list:l3 level1 lfo1;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial\">Participants will be able to understand the\r\nbenefits, limitations and clinical reasoning of the MSK ultrasound examination.</span></p>\r\n\r\n<h4 style=\"margin-top:0in;text-align:justify;line-height:normal;background:\r\nwhite;mso-background-themecolor:background1\"><span style=\"font-size:14.0pt;\r\nfont-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#7030A0;mso-bidi-language:BN-BD;\r\nfont-style:normal\">&nbsp;</span></h4>\r\n\r\n<h4 style=\"margin-top:0in;text-align:justify;line-height:normal;background:\r\nwhite;mso-background-themecolor:background1\"><span style=\"font-size:14.0pt;\r\nfont-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#7030A0;mso-bidi-language:BN-BD;\r\nfont-style:normal\">Who should attend? </span></h4>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\"><span style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:\r\nmajor-latin;mso-bidi-font-family:Arial;color:#0F2B3A;background:white\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l2 level1 lfo5\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A;background:white\">Radiologists, Orthopedic\r\nsurgeons, Sports physicians, Rheumatologists, Sonologists and Sonographers,\r\nPhysiatrists, Chiropractors, Physiotherapists, Athletic trainers, Osteopaths,\r\nand all other primary or secondary healthcare professionals who work in\r\nmusculoskeletal diagnostics and/or rehabilitation.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l4 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">This course has been designed for <b>radiologists,\r\nSonologists and sonographers or ultrasound technologists </b>who want to expand\r\ntheir horizon in next level of musculoskeletal ultrasound.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l4 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">It is also a highly relevant in the\r\nfield of <b>orthopedics and rheumatology</b> as “<b>POCUS</b>” or point of care\r\nUltrasonography.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l4 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">This course is extremely helpful for <b>physiotherapists\r\nand sports medicine specialists,</b> who can apply their skill in physiotherapy\r\nclinics and also directly in the sports-field for instant diagnosis of\r\nmusculoskeletal injuries and diseases and/or rehabilitation. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-.25in;mso-list:l4 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A;background:white\">Both primary and\r\nsecondary healthcare professionals interested in improving their diagnostic\r\ncapabilities and insight in treating dysfunctions of the musculoskeletal\r\nsystem.</span></p>\r\n\r\n\r\n\r\n<h4 style=\"margin-top:0in;text-align:justify;line-height:normal;tab-stops:151.8pt;\r\nbackground:white;mso-background-themecolor:background1\"><span style=\"font-size:\r\n14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#7030A0;mso-bidi-language:BN-BD;\r\nfont-style:normal\">Learning objectives: </span><span style=\"font-size:14.0pt;\r\nfont-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:Calibri;\r\nmso-fareast-theme-font:minor-latin;mso-bidi-font-family:Arial;color:#7030A0;\r\nfont-style:normal\"></span></h4>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:2.25pt;margin-right:0in;\r\nmargin-bottom:2.25pt;margin-left:.5in;mso-add-space:auto;background:white\"><span style=\"font-size:7.0pt;line-height:115%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:Arial;\r\ncolor:#0F2B3A\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:2.25pt;margin-right:0in;\r\nmargin-bottom:2.25pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nmso-list:l0 level1 lfo3;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">Understanding the concept of\r\nultrasound.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:2.25pt;margin-right:0in;\r\nmargin-bottom:2.25pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nmso-list:l0 level1 lfo3;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">What is the normal appearance of MSK\r\ntissues in ultrasound?</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:2.25pt;margin-right:0in;\r\nmargin-bottom:2.25pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nmso-list:l0 level1 lfo3;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">Learning how to use the ultrasound\r\nsystem.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:2.25pt;margin-right:0in;\r\nmargin-bottom:2.25pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nmso-list:l0 level1 lfo3;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">Understanding the functional anatomy\r\nof all extremity joints.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:2.25pt;margin-right:0in;\r\nmargin-bottom:2.25pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nmso-list:l0 level1 lfo3;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">Being able to scan all extremity\r\njoint protocols including muscles and ligaments in a correct &amp; reliable\r\nway.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:2.25pt;margin-right:0in;\r\nmargin-bottom:2.25pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nmso-list:l0 level1 lfo3;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">Being able to identify common\r\npathology in MSK ultrasound.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:2.25pt;margin-right:0in;\r\nmargin-bottom:2.25pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nmso-list:l0 level1 lfo3;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">Learning qualitative scanning and\r\npathology recognition.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:2.25pt;margin-right:0in;\r\nmargin-bottom:2.25pt;margin-left:.5in;mso-add-space:auto;text-indent:-.25in;\r\nmso-list:l0 level1 lfo3;background:white\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;color:#0F2B3A\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#0F2B3A\">Lots of hands-on practice with\r\nultrasound device.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:2.25pt;margin-right:0in;\r\nmargin-bottom:2.25pt;margin-left:.5in;mso-add-space:auto;background:white\"><span style=\"font-size:7.0pt;line-height:115%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:Arial;\r\ncolor:#0F2B3A\">&nbsp;</span></p>\r\n\r\n<h4 style=\"margin-top:0in;line-height:normal;background:white;mso-background-themecolor:\r\nbackground1\"><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;\r\nmso-bidi-font-family:Arial;color:#7030A0;font-style:normal\">Course Content:<span style=\"text-transform:uppercase\"></span></span></h4>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:1.0pt;\r\nline-height:115%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-hansi-theme-font