s.</span><span style=\"font-size:12.0pt;font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><b><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#7030A0;\r\nmso-bidi-language:BN-BD\">International Students</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l5 level1 lfo7;\r\nbackground:white\"><span style=\"font-size:12.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">We welcome students\r\nfrom other countries to enrich our campus life and foster life-long\r\nrelationships and international cultural interactions.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-list:l5 level1 lfo7;\r\nbackground:white\"><span style=\"font-size:12.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">We don’t have\r\naccommodation facilities at the moment for foreign students. However, if\r\nrequested earlier, we may assist to find suitable accommodation nearby the\r\ncampus.</span></p>', NULL, 165, 'This course has been designed for Radiologists, Sonologists, Sonographers, Rehabilitation specialists, physiotherapists who want to expand their horizon in next level of MSK ultrasound.', 9, 1, 'This course has been designed for Radiologists, Sonologists, Sonographers, Rehabilitation specialists, physiotherapists who want to expand their horizon in next level of MSK ultrasound.', '3.jpg', 'fa fa-book', 1, '2020-04-29 16:34:29', '2021-06-01 06:53:27');
