-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">o<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">A&nbsp;<b>“Certificate\r\nof Achievement”</b>&nbsp;shall be awarded to the participants who registers and\r\nsuccessfully completes all the requirement of the program.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:12.0pt;margin-right:0in;margin-bottom:\r\n12.0pt;margin-left:0in;line-height:normal;mso-outline-level:3;background:white\"><span style=\"font-size:14.0pt;font-family:&quot;Eras Bold ITC&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#414498;\r\nmso-bidi-language:BN-BD\">International Student:</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;text-indent:-.25in;line-height:normal;\r\nmso-list:l5 level1 lfo5;background:white\"><span style=\"font-size:12.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;\r\nmso-bidi-font-family:Symbol;color:#4A4949;letter-spacing:.75pt;mso-bidi-language:\r\nBN-BD\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">We welcome students\r\nfrom other countries to enrich our campus life and foster life-long relationships\r\nand international cultural interactions.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-align:justify;line-height:normal;background:white\"><span style=\"font-size:7.0pt;font-family:&quot;Candara&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD\">&nbsp;</span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:BN-BD\">We don’t have accommodation facilities at the\r\nmoment for foreign students. However, if requested earlier, we may assist to\r\nfind suitable accommodation nearby the campus.</span>', NULL, NULL, NULL, NULL, 0, 'Are you a Sonologist, Sonographer, Head-Neck or Breast Surgeon seeking practical ultrasound skills to help you answer key questions on the Thyroid & Neck problems or Breast diseases? Then this is the right course for you.', NULL, 'fa fa-book', 1, '2020-04-29 16:45:43', '2021-06-01 06:53:33');
