ce\r\ntheir skill in Neurosonology.</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-bottom:0in;margin-left:\r\n53.5pt;margin-bottom:.0001pt;text-indent:-.25in;mso-list:l4 level2 lfo1;\r\ntab-stops:list 53.5pt;background:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Arial;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">o<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">Neurosurgeons and\r\nNeurologist who want </span></b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">to learn Neurosonology\r\nas part of “Point of Care” ultrasound with North American standard and scanning\r\nprotocol.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;margin-bottom:0in;margin-left:\r\n53.5pt;margin-bottom:.0001pt;text-indent:-.25in;mso-list:l4 level2 lfo1;\r\ntab-stops:list 53.5pt;background:white\"><span style=\"font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Arial;color:#4A4949;\r\nletter-spacing:.75pt;mso-bidi-language:BN-BD;mso-bidi-font-weight:bold\"><span style=\"mso-list:Ignore\">o<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"font-family:&quot;Candara&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#4A4949;letter-spacing:.75pt;mso-bidi-language:BN-BD\">OBGYN specialist\r\nand residents inter