INSERT INTO `courses` (`id`, `course_name`, `homeName`, `homeDesc`, `homeIcon`, `creditHour`, `homePiority`, `inHome`, `short_desc`, `course_code`, `group_id`, `course_type_id`, `piority`, `inMenu`, `details`, `courseDuration`, `costing`, `keyFeatures`, `latestOrder`, `latestCourseStatus`, `short_details`, `image`, `icon`, `status`, `created_at`, `updated_at`) VALUES
(13, 'Diploma in Pediatric Ultrasound', NULL, NULL, NULL, '03', NULL, 0, 'Six month DMU in Pediatric Ultrasound', 'DPU-001', 1, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, 'It includes pediatric abdomen & pelvic ultrasound with Neurosonology of neonatal brain and spine. This course is intended for those who is interested for doing specialized pediatric sonography only.', NULL, NULL, 1, '2020-06-25 06:43:23', '2021-06-01 06:54:03'),
(14, 'Ultrasound for Midwives', NULL, NULL, NULL, '03', NULL, 0, 'Six month DMU in Obstetric Ultrasound', 'UTM-01', 1, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, 'This program is associated with ISUOG. It is intended for graduate midwives & nurses who are doing antenatal care of pregnant mothers in rural areas to help identifying high risk pregnancies with ultrasound & will refer for hospital delivery.', NULL, NULL, 1, '2020-06-25 06:43:54', '2021-06-01 06:54:17'),
(15, 'Breast Ultrasound', NULL, NULL, NULL, '03', NULL, 0, NULL, 'BU-01', 2, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, 'Are you a Sonologist, Sonographer or Breast Surgeon seeking practical ultrasound skills to help you answer key questions on breast diseases? Then this is the right course for you.', NULL, NULL, 1, '2020-06-25 07:04:16', '2021-06-01 06:54:29'),
(16, 'Follicle Tracing & Infertility Ultrasound', NULL, NULL, NULL, '03', NULL, 0, NULL, 'FTIU-01', 2, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, 'Are you a OBGYN specialist, Sonologist, Fertility clinicians or IVF technologist looking to develop your skill on Follicle tracking & infertility Ultrasound? Then this is the right course for you.', NULL, NULL, 1, '2020-06-25 07:04:54', '2021-06-01 06:54:35'),
