 <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 4\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 4\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 4\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin-top:0in;\r\n	mso-para-margin-right:0in;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0in;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	mso-bidi-font-size:14.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:Vrinda;\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-ansi-language:EN-IN;\r\n	mso-fareast-language:EN-IN;\r\n	mso-bidi-language:BN-BD;}\r\n</style>\r\n<![endif]-->\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;background:white\"><b><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">Dr. Mohammad Akhter Hossain</span></b><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\"> has built his career by identifying medical\r\nultrasound opportunities and shaping innovative training solutions to fulfil\r\ntheir potentials. With a true passion for education, his latest initiative has\r\nbeen the formation and growth of \"Shristy Institute for Health Sciences\r\n&amp; Technology\" - a dedicated school for ultrasound training solutions. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;background:white\"><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;background:white\"><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">As ultrasound imaging technology is becoming\r\nmore and more affordable and mobile, his mission is to provide medical doctors\r\nand allied health professionals, particularly those at the “<b>Point of care</b>”,\r\nwith the ultrasound skills that will promote best patient benefits.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal;background:white\"><span style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;background:white\"><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">From its inception, Dr. Hossain wanted Shristy\r\nInstitute to be a leader in South Asia in ultrasound training with the vision “Knowledge\r\nthrough technology”. With Dr. Hugh Anthony Ellis from Canada and fellow\r\nfaculties, this is being realized through the continuous creation and\r\ndevelopment of best educational programs in ultrasound. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal;background:white\"><span style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;background:white\"><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">Dr. Hossain is a very strong advocate for the\r\nuse of ultrasound and its application beyond traditional boundaries, a view he\r\nmaintains as a supporter of free and open access medical education initiative. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal;background:white\"><span style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;background:white\"><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">Prior to the creation of Shristy Institute for\r\nultrasound training solutions in Bangladesh, he has worked as Physician Sonologist\r\nand also worked extensively in all other branches of medical imaging to get\r\ncross-training in CT scan, MRI, X-ray, Mammography in Medinova Medical Services\r\nsince its inception at 1992. In fact he played a pivotal role in establishing\r\nMedinova Medical Services, the first and largest imaging center in both public\r\nand private sector with installing the first CT scan, first MRI, first digital\r\nfluoroscopy, first mammography, and first 3/4D ultrasound and recently first\r\nPET-CT in Bangladesh.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal;background:white\"><span style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal;background:white\"><span style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;background:white\"><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">Dr. Hossain graduated as a medical doctor with\r\nMBBS from Sir Salimullah Medical College, Dhaka in 1982. After working as\r\ngeneral physician in both public and private sector, in home and abroad, he\r\nstarted his career as a Sonologist in Medinova in 1992. Then he took his\r\nAdvance Graduate diploma in Medical Ultrasonography from the Michener\r\nInstitute, Canada. With his relentless pursuit of advancement, he took the ARDMS\r\nregistry examination and obtained the globally recognized RDMS in abdominal and\r\nsmall parts ultrasound, OB/GYN ultrasound and RVT credentials in Vascular Doppler\r\nSonography from USA.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal;background:white\"><span style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;background:white\"><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">In 2013, he achieved Fellowship in Academic\r\nultrasound, Fetal-Maternal Medicine, Fetal and Adult Echocardiography from\r\nThomas Jefferson University, USA. Besides, he has participated in many short\r\nterm training program and seminars in vascular Doppler ultrasound, MSK\r\nultrasound, OB/GYN ultrasound in Canada, India, Belgium &amp; USA, Singapore\r\nand Germany.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal;background:white\"><span style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;background:white\"><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">With his continuous effort and initiative in\r\npreparing the students for ARMDS accreditation, many students at Shristy\r\nInstitute inspired and taken the most wanted ARDMS licensing examination with\r\nalmost 100% success rate and are now doing job across Canada and USA.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal;background:white\"><span style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222\" lang=\"EN-IN\">&nbsp;</span></p>\r\n\r\n<span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222;mso-ansi-language:EN-IN;\r\nmso-fareast-language:EN-IN;mso-bidi-language:BN-BD\" lang=\"EN-IN\">In a Clinical setting, Dr.\r\nHossain is a highly qualified General Sonologist, with a particular interest\r\nand specialization in Obstetrics, Fetal-Maternal Medicine, Vascular Doppler &amp;\r\nMusculoskeletal Ultrasound.</span>', 1, NULL, '1589477039.png', 'profile1.jpg', 1, '2020-05-14 17:23:59', '2020-07-02 07:37:41');
INSERT INTO `faculties` (`id`, `name`, `doctorTitle`, `profileTitle`, `profile`, `piority`, `details`, `image`, `profile_pic`, `status`, `created_at`, `updated_at`) VALUES
(2, 'Dr. Hugh Anthony Ellis', '<p class=\"MsoNormal\" align=\"center\"><span style=\"font-size:12.0pt;line-height:115%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">MD, MSc (Clinical\r\nanatomy), RDMS, RVT, ARRT</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" align=\"center\"><span style=\"font-size:12.0pt;line-height:115%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">CEO &amp; Program\r\nDirector</span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\"><span style=\"font-size:12.0pt;line-height:115%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">Institute of\r\nUltrasound Technique (IUT), Canada</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" align=\"center\"><span style=\"font-size:12.0pt;line-height:115%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">Currently working\r\nin Jamaica as </span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\"><span style=\"font-size:12.0pt;line-height:115%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">Physician and\r\nSonologists </span></p>\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" align=\"center\"><span style=\"font-size:12.0pt;line-height:115%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">Visiting Faculty\r\n&amp; Honorary Adviser, </span></p>\r\n\r\n<p class=\"MsoNormal\" align=\"center\"><span style=\"font-size:12.0pt;line-height:115%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">Curriculum\r\nDevelopment </span></p>\r\n\r\n<div align=\"center\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Calibri&quot;,sans-serif;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-theme-font:minor-latin;mso-ansi-language:EN-IN;mso-fareast-language:\r\nEN-IN;mso-bidi-language:BN-BD\" lang=\"EN-IN\">Shristy Institute for Health Sciences &amp;\r\nTechnology</span></div>', '<p class=\"MsoNormal\" style=\"text-align: right; \"><b><span lang=\"EN-IN\" style=\"font-size:14.0pt;line-height:\r\n115%;font-family:&quot;Candara&quot;,sans-serif\">Dr. Hugh A. Ellis <o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align: right;\"><b><span lang=\"EN-IN\" style=\"font-size:14.0pt;line-height:\r\n115%;font-family:&quot;Candara&quot;,sans-serif\">CEO &amp; Program Director<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align: right;\"><b><span lang=\"EN-IN\" style=\"font-size:14.0pt;line-height:\r\n115%;font-family:&quot;Candara&quot;,sans-serif\">Institute of Ultrasound Technique,\r\nCanada<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align: right;\"><b><span lang=\"EN-IN\" style=\"font-size:14.0pt;line-height:\r\n115%;font-family:&quot;Candara&quot;,sans-serif\">Honorary Adviser &amp; Clinical\r\nInstructor<o:p></o:p></span></b></p><p style=\"text-align: right; \">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<b><span lang=\"EN-IN\" style=\"font-size: 18px; line-height: 115%; font-family: Candara, sans-serif;\">Shristy Institute&nbsp;</span><span style=\"font-family: Calibri, sans-serif; font-size: 18px;\">for Health Sciences &amp; Technology</span></b><br></p>', '<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\nnormal;mso-layout-grid-align:none;text-autospace:none\"><b><span lang=\"EN-IN\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif\">Dr. Hugh A. Ellis</span></b><span lang=\"EN-IN\" style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif\"> born, in\r\nthe beautiful island of Jamaica, has spent more than 28 years living in Canada.\r\nHe has had the privilege of working in medical imaging for most of his life and\r\nhas such is quite passionate about ultrasound imaging. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;mso-layout-grid-align:\r\nnone;text-autospace:none\"><span lang=\"EN-IN\" style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;mso-layout-grid-align:\r\nnone;text-autospace:none\"><span lang=\"EN-IN\" style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif\">He has established his own ultrasound teaching and training\r\ncenter “<b>Institute of Ultrasound Training (IUT)</b>” in Toronto and trained\r\nmany international students for ARDMS registry preparation examination for long\r\nyears. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;mso-layout-grid-align:\r\nnone;text-autospace:none\"><span lang=\"EN-IN\" style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;mso-layout-grid-align:\r\nnone;text-autospace:none\"><span lang=\"EN-IN\" style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif\">He has travelled to Bangladesh over 16 times, first 2 times\r\nas Clinical Instructor on behalf of The Michener Institute for Applied Heath\r\nSciences, Canada to train the students at Shristy Institute an affiliated Dhaka\r\ncampus of The Michener from 2000 to 2003 and thereafter from his own IUT, for\r\nadvance sonographic training to students of Shristy Institute and other local\r\nand Internationally trained doctors in ultrasonography and offered Advance\r\nDiploma in Medical Sonography from IUT. This program is still continuing with\r\nShristy Ultrasound. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;mso-layout-grid-align:\r\nnone;text-autospace:none\"><span lang=\"EN-IN\" style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;mso-layout-grid-align:\r\nnone;text-autospace:none\"><span lang=\"EN-IN\" style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif\">He has a Doctor of Medicine degree, Masters in Clinical\r\nAnatomy, RDMS, RVT and ARRT credentials from American Registry for Diagnostic\r\nMedical Sonography (ARDMS). Dr. Ellis is currently working in his native country,\r\nhelping with the Covid-19 crisis, but his true passion is ultrasound and its\r\ntraining. It would be better to say that he has a “<b>Magic hand</b>” in\r\nultrasound hands-on. He is “<b>GURU</b>” in North America in ultrasound\r\ntraining.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;text-justify:inter-ideograph;line-height:normal;mso-layout-grid-align:\r\nnone;text-autospace:none\"><span lang=\"EN-IN\" style=\"font-size:12.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif\"><o:p>&nbsp;</o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<span lang=\"EN-IN\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-theme-font:minor-fareast;\r\nmso-ansi-language:EN-IN;mso-fareast-language:EN-IN;mso-bidi-language:BN-BD\">Dr.\r\nEllis is happy to have partner-shipped with Shristy ultrasound over this\r\nextended period and would like to thanks Dr. Akhter and family for their\r\nhospitality and support over the years.</span><br></p>', 2, NULL, '1589477288.png', 'profile2.jpg', 1, '2020-05-14 17:28:08', '2020-07-02 07:41:35'),
(3, 'Dr. Tansena Akhter', '<p class=\"MsoNormal\" align=\"center\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n15.0pt;line-height:115%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">MBBS,\r\nMPhil, DMUD (Shristy), <o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n15.0pt;line-height:115%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">RDMS\r\n(AB, OBGYN, BR), RMSKS (MSK), RVT (VT)<o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n15.0pt;line-height:115%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">Certificate\r\nin Vascular Doppler, Transvaginal, Fetal anomaly and Musculoskeletal\r\nSonography,<o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n15.0pt;line-height:115%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">Certificate\r\nin MSK Ultrasound (Michener Institute, Canada)</span></p><p class=\"MsoNormal\" align=\"center\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n15.0pt;line-height:115%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">Senior\r\nLecturer &amp; Clinical Instructor <o:p></o:p></span></b></p><p class=\"MsoNormal\" align=\"center\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n15.0pt;line-height:115%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">(SPI,\r\nMSK &amp; Vascular Doppler Sonography)&nbsp;</span><span style=\"font-size: 12pt;\">and</span></p><p class=\"MsoNormal\" align=\"center\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n15.0pt;line-height:115%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">Course\r\nCoordinator</span></b></p><p class=\"MsoNormal\" align=\"center\"><span style=\"font-size: 12pt;\">Shristy\r\nInstitute for Health Sciences &amp; Technology</span></p>', NULL, NULL, 3, NULL, '1618292125.jpg', NULL, 1, '2020-05-24 18:58:26', '2021-04-13 05:35:25'),
