INSERT INTO `quiz_options` (`id`, `serial`, `quiz_id`, `question`, `image`, `option1`, `option2`, `option3`, `option4`, `correct_ans`, `discription`, `status`, `created_at`, `updated_at`) VALUES
(1, 1, 1, 'A 22 year old female, with a recent positive urine pregnancy test, reports for a pelvic sonogram. Her clinical indication states that she is G4P1 with a history of habitual spontaneous abortions. How many live births has this patient had?', NULL, 'None', 'One', 'Three', 'Three', 'option2', '(One). She is on her 4th pregnancy (G$) with history of one live birth (P1).', 1, '2020-06-24 04:49:39', '2020-06-24 11:14:37'),
(2, 2, 1, 'which of the following is true of urine pregnancy tests?', NULL, 'a positive test will help date the pregnancy.', 'urine pregnancy tests are considered qualitative.', 'there are two standards of measurement for urine hCG levels.', 'the amount of hCG is measured.', 'option2', 'Urine pregnancy tests are considered qualitative. Serum hCG is quantitative.', 1, '2020-06-24 04:51:23', '2020-06-24 11:15:03'),
(3, 3, 1, 'Transvaginal ultrasound examination of a 25 year old patient reveals a gestational sac with a MSD of 20mm. There is a yolk sac, but no visible embryo or cardiac activity. Which of the following statements best reflects the sonographic predictions about the status of this pregnancy?', NULL, 'this pregnancy is not far enough along to demonstrate embryonic cardiac activity.', 'the presence of a yolk sac suggests a normal intrauterine pregnancy.', 'until an embryo is identified, it is impossible to predict pregnancy failure.', 'the MSD size criteria and gestational contents suggest a failed pregnancy.', 'option4', 'Embryo must be seen when MSD is ≥16mm on transvaginal sonogram and MSD ≥25mm on transabdominal sonogram.', 1, '2020-06-24 05:02:46', '2020-06-24 11:15:26'),
(4, 4, 1, 'With transvaginal imaging, a yolk sac must be seen when the MSD is at least:', NULL, '8 mm', '16 mm', '20 mm', '25 mm', 'option1', NULL, 1, '2020-06-24 05:11:10', '2020-06-24 05:11:10'),
(5, 5, 1, 'With transvaginal imaging, an embryo should be seen when the MSD is at least:', NULL, '8 mm', '16 mm', '20 mm', '25 mm', 'option2', NULL, 1, '2020-06-24 05:12:24', '2020-06-24 05:12:24'),
(6, 6, 1, 'Which of the following symptoms is most commonly associated with spontaneous abortion?', NULL, 'nausea and vomiting', 'Vaginal bleeding', 'low haemoglobin', 'small for dates', 'option2', NULL, 1, '2020-06-24 05:13:21', '2020-06-24 05:13:21'),
(7, 7, 1, 'The maximum normal yolk sac diameter should not exceed:', NULL, '2 mm', '4 mm', '6 mm', '8 mm', 'option3', NULL, 1, '2020-06-24 05:14:13', '2020-06-24 05:14:13'),
(8, 8, 1, 'The term gastrulation refers to:', NULL, 'Formation of gastrointestinal tract.', 'Formation of yolk sac.', 'Development of swallowing reflex.', 'Conversion of bilaminar disk to trilaminar disk.', 'option4', NULL, 1, '2020-06-24 05:19:55', '2020-06-24 05:19:55'),
(9, 9, 1, 'The function of yolk sac includes all of the following except:', NULL, 'Haematopoiesis', 'Transfer of nutrients.', 'Production of hCG', 'Formation of the digestive tract.', 'option3', 'hCG is produced by trophoblastic cell in early pregnancy and later by the placenta.', 1, '2020-06-24 05:20:59', '2020-06-24 05:20:59'),
(10, 10, 1, 'The first organ system to begin developing around week 5 is the:', NULL, 'Central nervous system.', 'GI tract.', 'Genitourinary tract.', 'Cardiovascular system.', 'option4', NULL, 1, '2020-06-24 05:21:49', '2020-06-24 05:21:49'),
(11, 11, 1, 'Which of the following best describes the typical sonographic appearance of a normal 5.5 weeks gestation?', NULL, 'thickened endometrium with no evidence of gestational sac.', 'an empty gestational sac within a decidual layer.', 'a gestational sac containing only a yolk sac.', 'a gestational sac containing a yolk sac and an embryo.', 'option3', 'a gestational sac containing only a yolk sac is typically seen at 5.5 weeks gestation. ', 1, '2020-06-24 05:22:42', '2020-06-24 05:22:42'),
(12, 12, 1, 'AIUM guidelines for first trimester ultrasound evaluation include all of the following except:', NULL, 'Location of the sac.', 'Location of the placenta.', 'Measurement of the sac and embryo.', 'Evaluation of the uterus and adnexa.', 'option2', 'Placenta is not yet formed in first trimester. ', 1, '2020-06-24 05:36:12', '2020-06-24 05:36:12'),
(13, 13, 1, 'A 25 year old female patient presents for an OB-sonogram at 7 weeks gestation with left lower quadrant pain and spotting. Her beta hCG levels have risen at a subnormal rate over the last 72 hours and no IUP is identified. Which of the following is most likely explains the symptoms and ultrasound findings?', NULL, 'a molar pregnancy.', 'an ectopic pregnancy.', 'Spontaneous abortion.', 'a ruptured corpus luteum Hemorrhagicum.', 'option2', 'History of 7 weeks gestation, no IUP with LLQ pain and spotting, with subnormal hCG is a almost confirmed case of ectopic pregnancy. ', 1, '2020-06-24 05:37:17', '2020-06-24 05:37:17'),
(14, 14, 1, 'Which of the following is the most common site for ectopic pregnancy implantation?', NULL, 'Interstitial portion of the fallopian tube.', 'Ampulla of the fallopian tube.', 'The ovaries.', 'Posterior cul-de-sac.', 'option2', 'almost 98% ectopic pregnancy occurs at ampulla and isthmus of the fallopian tube. ', 1, '2020-06-24 05:38:11', '2020-06-24 05:38:11'),
(15, 15, 1, 'A patients presents for an OB-sonogram at 14 weeks gestation with history of hyperemesis, LGA, and increased hCG levels. Ultrasound reveals a heterogeneous soft tissue mass within the endometrial cavity, with no evidence of a fetus. Which of the following is the most likely diagnosis?', NULL, 'Incomplete abortion.', 'Retained product of conception.', 'Hydatidiform mole.', 'Pseudogestational sac.', 'option3', '', 1, '2020-06-24 05:38:58', '2020-06-24 05:38:58'),
(16, 16, 1, 'Sonographic findings suggestive of an ectopic pregnancy include all of the following except:', NULL, 'tubal ring.', 'no intrauterine pregnancy.', 'echogenic free fluid.', 'complex myometrial mass.', 'option4', NULL, 1, '2020-06-24 05:39:36', '2020-06-24 05:39:36'),
(17, 17, 1, 'Which of the following lists the classic triad of symptoms for ectopic pregnancy?', NULL, 'Shock, pain and no ultrasound evidence of IUP.', 'History of pelvic inflammatory disease, amenorrhoea and pain.', 'Vaginal bleeding, lower abdominal pain and a palpable adnexal mass.', 'Vaginal bleeding, hypotension and a palpable adnexal mass.', 'option3', 'Vaginal bleeding, lower abdominal pain and a palpable adnexal mass are the classic triad for diagnosis of ectopic pregnancy, seen only in 14% of cases. ', 1, '2020-06-24 05:40:38', '2020-06-24 05:40:38'),
(18, 18, 1, 'What does the term discriminatory zone refer to?', NULL, 'The hormone level at which a decidual reaction is evident.', 'The hCG level at which a gestational sac can be visualized sonographically.', 'The scanner setting necessary to visualize an early pregnancy.', 'The gestational sac criteria used to identify normal pregnancy.', 'option2', 'It is the level of hCG at which a double-decidual gestational sac should be seen sonographically. It not seen, it suggests possibility of ectopic pregnancy.', 1, '2020-06-24 06:28:56', '2020-06-24 06:28:56'),
(19, 19, 1, 'Mid-gut herniation is a normal phenomenon during which gestational weeks?', NULL, '04-8 weeks.', '08-12 weeks.', '12-14 weeks.', '18-22 weeks', 'option2', NULL, 1, '2020-06-24 06:29:42', '2020-06-24 06:29:42'),
(20, 20, 1, 'Which of the following best describes the ultrasound appearance and location of the Rhombencephalon in a 9 week gestation?', NULL, 'an anechoic cystic area within the choroid plexus.', 'a cystic area in the upper abdomen.', 'a cystic area in the posterior part of the brain.', 'an echogenic area in the posterior brain.', 'option3', 'Rhombencephalon is seen as an anechoic cystic area in the posterior brain between 8-12 weeks and then regresses forming the base of the brain. If persists beyong 12 weeks, considered posterior fossa cyst, an anomaly. ', 1, '2020-06-24 06:30:29', '2020-06-24 06:30:29'),
(21, 21, 1, 'Which of the following structures implants into the endometrium?', NULL, 'Zygote.', 'Morula.', 'Embryo.', 'Blastocyst.', 'option4', 'Blastocyst. Within the fallopian tube, cells of the zygote multiply, forming a cluster of cells called morula. Fluid rapidly fills the morula forming blastocyst. The blastocyst reaches the uterine cavity and implants into the endometrium by D21.  ', 1, '2020-06-24 06:31:24', '2020-06-24 06:31:24'),
(22, 22, 1, 'The optimal gestational age for measuring fetal NT is from:', NULL, '10 weeks 0 days to 12 weeks 0 days.', '11 weeks to 14 weeks.', '11 weeks 0 days to 13 weeks 06 days.', '11 weeks 0 days to 14 weeks 06 days.', 'option3', NULL, 1, '2020-06-24 06:32:05', '2020-06-24 06:32:05'),
(23, 23, 1, 'Which area of the embryo attaches to the amnion?', NULL, 'calvaria.', 'nuchal fold.', 'abdomen.', 'umbilical cord insertion.', 'option4', 'The amnion attaches to the embryo at the umbilical cord insertion.', 1, '2020-06-24 06:32:51', '2020-06-24 06:32:51'),
(24, 24, 1, 'Which area of the embryo attaches to the amnion?', NULL, 'calvaria.', 'nuchal fold.', 'abdomen.', 'umbilical cord insertion.', 'option4', 'The amnion attaches to the embryo at the umbilical cord insertion.', 1, '2020-06-24 06:34:17', '2020-06-24 06:34:17'),
(25, 25, 1, 'The MSD measures gestational age before visualization of the:', NULL, 'amnion.', 'embryo.', 'yolk sac.', 'fetal cardiac activity.', 'option2', 'Embryo (CRL). Measurement og gestational age begins with the MSD. But, once embryo is seen, CRL is the best measurement for gestational age with highest accuracy.', 1, '2020-06-24 06:35:01', '2020-06-24 06:35:01'),
(26, 26, 1, 'Gestational weeks 6 through 10 constitute the:', NULL, 'Fetal phase', 'First trimester.', 'Embryonic phase.', 'Conceptus phase.', 'option3', 'Embryonic phase.  After 10 weeks, no more embryo, now it called fetus. 11 -12 weeks of first trimester is part of the fetal phase. ', 1, '2020-06-24 06:35:53', '2020-06-24 06:35:53'),
(27, 27, 1, 'The decidual capsularis and the decidua parietalis produce the:', NULL, 'blastocyst.', 'decidua basalis.', 'double decidua sign.', 'Pseudogestational sac.', 'option3', ' the double decidual sign is composed of decidual capsularis and decidua parietalis giving the appearance of a thick hyperechoic rim surrounding an intrauterine pregnancy. ', 1, '2020-06-24 06:40:52', '2020-06-24 06:40:52'),
(28, 28, 1, 'A rapid decline in serial hCG levels will most likely correlate with a(n):', NULL, 'spontaneous abortion.', 'anembryonic pregnancy.', 'ectopic pregnancy.', 'heterotopic pregnancy.', 'option1', 'a rapid decline in hCG levels is most likely correlates with spontaneous abortion (or miscarriage). In anembryonic pregnancy, the gestational sac will continue to grow, as such keeping the hCG levels elevated. ', 1, '2020-06-24 06:45:34', '2020-06-24 06:45:34'),
(29, 29, 1, 'Which of the following is an abnormal finding in first a trimester pregnancy?', NULL, 'Prominent cystic structure in the posterior brain.', 'Visualization of the amnion without an embryo.', 'Herniation of bowel into the umbilical cord.', 'fetal heart rate of 100 beats per minute.', 'option2', 'Visualization of the amnion without a coexisting embryo is an abnormal finding. Rhombencephalon as a cystic structure in posterior brain and the mid-gut herniation are normal findings between 8-11 weeks.  ', 1, '2020-06-24 06:50:38', '2020-06-24 06:50:38'),
(30, 30, 1, 'Normally the chorionic cavity should no longer be visible after how many gestational weeks?', NULL, '10-12 weeks.', '12-14 weeks.', '14-16 weeks.', '16-20 weeks.', 'option3', 'The amniotic membrane expands with the growth of the fetus at a faster rate than the chorion and fuses with the chorion by 14-16 weeks gestation, obliterating the chorionic cavity. ', 1, '2020-06-24 06:52:33', '2020-06-24 06:52:33'),
(31, 31, 1, 'Hyperemesis is a common clinical findings associated with:', NULL, 'Ectopic pregnancy.', 'Embryonic demise.', 'Trophoblastic disease.', 'heterotopic pregnancy.', 'option3', 'Hyperemesis is a common clinical findings associated with trophoblastic disease or molar pregnancy. Multiple pregnancies (twin or triplet) are another common consideration', 1, '2020-06-24 06:53:16', '2020-06-24 06:53:16'),
(32, 32, 1, 'A patient with a positive pregnancy test and an hCG level of 750mIU/mL. Based on this clinical history, which of the following best describes the expected sonographic findings?', NULL, 'Small gestational sac on transabdominal imaging.', 'Possible small gestational sac on transvaginal imaging.', 'Yolk sac within a gestational sac on transvaginal imaging.', 'Gestational sac with viable embryo on transvaginal imaging.', 'option2', 'An hCG level of 1000 mIU/mL normally demonstrates a small gestational sac on TV imaging. Levels as low as 500 mIU/mL may demonstrate a small gestational sac with the TV approach. ', 1, '2020-06-24 06:54:06', '2020-06-24 06:54:06'),
(33, 33, 1, 'Normal human chorionic gonadotropin levels should:', NULL, 'double every 24 hours.', 'double every 48 hours.', 'Peak at 20th gestational week.', 'Decrease and level out after the 12th gestational week.', 'option2', 'Normal hCG level should double every 48 hours. Levels peak at the 10th gestational week and then begin to decline until 18th week, where they level out for the duration of the pregnancy. ', 1, '2020-06-24 06:54:49', '2020-06-24 06:54:49'),
(34, 34, 1, 'On transvaginal imaging, in a normal pregnancy, cardiac activity must be identified within the embryo with a CRL of:', NULL, '2 mm', '3 mm', '4 mm', '5 mm', 'option4', 'Cardiac activity in an embryo must be seen when the CRL is 5 mm. If the CRL is equal to 7 mm on TV imaging and no cardiac activity seen, suggests embryonic demise (missed abortion).', 1, '2020-06-24 06:55:30', '2020-06-24 06:55:30'),
(35, 35, 1, 'Presence of an embryo without visualization of the amnion in early pregnancy is considered:', NULL, 'a normal finding.', 'suspicious for fetal demise.', 'suspicious for amniotic band syndrome.', 'a precursor of abdominal wall defect.', 'option1', 'Failure to visualize the amnion surrounding an embryo is a normal finding. However, visualization of an amnion without identifying an embryo is an abnormal finding.', 1, '2020-06-24 06:56:44', '2020-06-24 06:56:44'),
(36, 36, 1, 'Which of the following is an abnormal sonographic finding during the first trimester of pregnancy?', NULL, 'Failure to demonstrate an amnion adjacent to an embryo.', 'Failure to demonstrate a yolk sac within a MSD of 10 mm when using transvaginal approach.', 'Failure to demonstrate a yolk sac within a MSD of 15 mm when using transabdominal approach.', 'Failure to demonstrate an embryo within a MSD of 20 mm when using transabdominal approach.', 'option2', 'When using a transvaginal (TV) approach, failure to demonstrate a yolk sac within a MSD of ≥8mm is an abnormal sonographic finding and is suspicious of anembryonic gestation or blighted ovum. ', 1, '2020-06-24 07:02:16', '2020-06-24 07:02:16'),
(37, 37, 1, 'When measuring the MSD, the callipers should be placed from the:', NULL, 'inner wall to inner wall.', 'inner wall to outer wall.', 'outer wall to outer wall.', 'anterior wall to posterior wall.', 'option1', 'callipers must be placed from the inner to inner wall.', 1, '2020-06-24 07:03:02', '2020-06-24 07:03:02'),
(38, 38, 1, 'The secondary yolk sac:', NULL, 'has no specific function.', 'is located in the chorionic cavity.', 'represents the developing chorionic villi.', 'secretes human chorionic gonadotropin.', 'option2', 'secondary yolk sac lies in the chorionic cavity and provides nutrition to the developing embryo. The embryo lies in the amniotic cavity, connected with the yolk sac by vitelline duct. Trophoblastic cells secrete the hCG.  ', 1, '2020-06-24 07:03:51', '2020-06-24 07:03:51'),
(39, 39, 1, 'Hyperechoic choroid plexuses are expected to visualize earliest by:', NULL, '8-9 week gestation.', '10-12 week gestation.', '12-14 week gestation.', '14-16 week gestation.', 'option1', NULL, 1, '2020-06-24 07:04:43', '2020-06-24 07:04:43'),
(40, 40, 1, 'Which of the following ectopic location of pregnancy is most life threatening to the patient?', NULL, 'cervical ectopic.', 'ampulary.', 'interstitial.', 'peritoneal.', 'option3', 'This area is at the uterine cornu with myometrial tissue and is highly vascular, tends to grow and rupture lately around 13-14 week gestation causing catastrophic bleeding. ', 1, '2020-06-24 07:05:27', '2020-06-24 07:05:27'),
(41, 41, 1, 'Which of the following lines the chorion and contains the fetus?', NULL, 'amnion.', 'decidual basalis.', 'trophoblast.', 'Chorion frondosum.', 'option1', 'The amnion is an extra embryonic membrane lines the chorion and contains the fetus and amniotic fluid. ', 1, '2020-06-24 07:06:51', '2020-06-24 07:06:51'),
(42, 42, 1, 'Chorionic villi are more prolific:', NULL, 'adjacent to the yolk sac.', 'opposite the cervical os.', 'near the implantation site.', 'Near the uterine fundus.', 'option3', 'The chorionic villi are more prolific near the implantation site, and with decidua basalis forms the placenta. ', 1, '2020-06-24 07:07:33', '2020-06-24 07:07:33'),
(43, 43, 1, 'Which of the following is the first system to function in the developing embryo?', NULL, 'Central nervous system', 'Respiratory system', 'Genitourinary system', 'Cardiovascular system.', 'option4', NULL, 1, '2020-06-24 07:08:16', '2020-06-24 07:08:16'),
(44, 44, 1, 'Human chorionic gonadotropin level peaks at:', NULL, '10th gestational week.', '12th gestational week.', '14th gestation week.', '18th gestational week.', 'option1', 'hCG level peaks at 10th gestational week (100,000 mIU/mL) and the starts declining, levelling off around 18th weeks (5000mIU/mL). ', 1, '2020-06-24 07:10:26', '2020-06-24 07:10:26'),
(45, 45, 1, 'A corpus Luteum is most likely misdiagnosed as a(n):', NULL, 'hydrosalphinx.', 'missed abortion.', 'ectopic pregnancy.', 'anembryonic gestation.', 'option3', 'ectopic pregnancy. A hypervascular peripheral rim is seen around both the corpus Luteum and trophoblastic tissue of an ectopic pregnancy and termed as “Ring of fire”. ', 1, '2020-06-24 07:11:55', '2020-06-24 07:11:55'),
(46, 46, 1, 'The anechoic cystic structure (Black arrow) in the embryo in the fig. 01 is consistent with:', '1592982794.png', 'Choroid plexus cyst.', 'Hydrocephalus.', 'Rhombencephalon.', 'Cystic hygroma.', 'option3', 'The cyst in the posterior part of the fetal brain is physiological Rhom', 1, '2020-06-24 07:13:14', '2020-06-24 07:13:14'),
(47, 47, 1, 'The most likely diagnosis for the 10mm large cystic structure, in fig.', '1592983827.png', 'Blighted ovum.', 'Large yolk sac.', 'Amniotic cavity.', 'Omphalomesenteric cyst.', 'option2', 'Yolk sac >6mm is considered as Large yolk sac, indicates abnormal yolk sac. Normal size yolk sac must be between 3-6mm throughout first trimester pregnancy.', 1, '2020-06-24 07:30:27', '2020-06-24 07:30:27'),
(48, 48, 1, '25 year old female, with history of 8 weeks amenorrhoea, positive pregnancy test, and vaginal spotting with following ultrasound image. What does the arrow indicates in the fig', '1592983918.png', 'Retained product of conception.', 'Threatened abortion.', 'Subchorionic hematoma.', 'Missed abortion.', 'option3', NULL, 1, '2020-06-24 07:31:58', '2020-06-24 07:31:58'),
(49, 49, 1, 'A 27 year old female, G3P2, complains of pelvic pain, vaginal bleeding. Ultrasound image shown in fig. 04: What is the most likely diagnosis?', '1592983983.png', 'Complete abortion.', 'Missed abortion.', 'Incomplete abortion.', 'Molar pregnancy.', 'option3', 'Thickened and irregular endometrium with histoty of pregnancy (G3P4), pelivic pain and vaginal bleeding is consistent with incomplete abortion with retained product of conception (RPOC). ', 1, '2020-06-24 07:33:03', '2020-06-24 07:33:03'),
(50, 50, 1, 'A 30 year old female, G2P1, complains of pelvic pain, menorrhagia. The serum hCG was 4,500mIU/mL, no intrauterine pregnancy (No IUP) seen in the first sonogram. The serum hCG was repeated after 48 hours with findings of 4,900 mIU/mL. Fig.05 is repeat transvaginal scan. What is the most likely diagnosis?', '1592984055.png', 'Complete abortion.', 'Ectopic pregnancy.', 'Missed abortion.', 'Corpus Luteum Hemorrhagicum.', 'option2', 'The right adnexal cystic mass, pain, menorrhagia, positive hCG, failed to double in 48 hours, no IUP, strongly suggests right adnexal ectopic pregnancy. ', 1, '2020-06-24 07:34:15', '2020-06-24 07:34:15'),
(51, 1, 2, 'What is the earliest age at which a gestational sac may be visualized by transvaginal ultrasound?', NULL, '4 weeks', '5 weeks', '6 weeks', '7 weeks', 'option2', 'There is a limitation on what can be seen by human eye using medical imaging. A 7-9 MHz TV transducer can depict a 5mm gestational sac as early as 4.5 weeks to 5 weeks.', 1, '2020-06-24 08:23:08', '2020-06-24 11:00:23'),
(52, 2, 2, 'Which of the following best describes intrauterine embryonic demise?', NULL, 'Blighted ovum.', 'Missed abortion.', 'Absent cardiac pulsation when CRL is more than 7mm.', 'D. B & C.', 'option4', 'Absent cardiac pulsation when the CRL is more than 7mm is a definite and specific sign of embryonic demise or death. Intrauterine Embryonic or fetal death on or before 28 weeks (in some country 20 weeks) is defined as missed abortion and after that period, death of fetus is called IUD. In blighted ovum, embryo failed to develop.', 1, '2020-06-24 08:25:05', '2020-06-24 11:01:06'),
(53, 3, 2, 'What is the first definitive sign of intrauterine pregnancy?', NULL, 'Gestational sac.', 'Yolk sac.', 'Decidual reaction (Thickened endometrium)', 'Embryo.', 'option2', 'The first predictive sign of IUP is the gestational sac. However, a pseudo-sac can be seen in the endometrial cavity in ectopic pregnancy. Hence, the yolk sac is considered the earliest or first surest sign of an IUP.', 1, '2020-06-24 08:25:47', '2020-06-24 11:04:27'),
(54, 4, 2, 'What is the accuracy of CRL for gestational age and dating in the 1st trimester?', NULL, '±3-5 days', '±10 days', '±14 days.', '±21 days.', 'option1', 'Fetal growth in the first trimester is very uniform thus allowing for more accurate dating. CRL is considered the most accurate biometry for dating with minimum varability of ±3-5 days, if taken between 6-8 weeks. Later due to flexion or extension of the fetus, this increases to ±5-7 days.', 1, '2020-06-24 08:26:30', '2020-06-24 11:05:05'),
(55, 5, 2, 'What is the accuracy of gestational age and dating from 13 weeks to 20 weeks?', NULL, '±3-5 days', '±10 days', '±14 days', '±21 days', 'option2', 'with advancing gestational age, error in gestational age and dating calculation increases due to increasing biologic variations in the fetuses. Hence, multiple parameters such as BPD, HC, FL are used for calculation of gestational age.', 1, '2020-06-24 08:27:14', '2020-06-24 11:05:25'),
(56, 6, 2, 'What is the accuracy of gestational age and dating in third trimester of pregnancy?', NULL, '±3-5 days', '±10 days', '±14 days', '±21 days', 'option4', 'Fetus shows large number of biologic variation in third trimester and accuracy for gestational age is the least with variation of 3-4 weeks, largest range of error.  Therefore EDD done with CRL in first trimester should not be change in subsequent examinations.', 1, '2020-06-24 08:28:03', '2020-06-24 11:05:57'),
(57, 7, 2, 'What is the most accurate method for establishing the estimated date of confinement or EDD?', NULL, 'CRL in first trimester ultrasound.', 'BPD/HC/FL in second trimester.', 'Calculating from LMP.', 'Nigel’s rule.', 'option1', 'Fetus shows least or almost no biologic variation in first trimester with uniform growth pattern. Hence CRL is the best parameter for determining EDD with accuracy ±3-5 days. BPD, HC & FL are also good in early 2nd trimester before 20 weeks but accuracy is ±10 days. Later in 3rd trimester the accuracy is least with ±3-4 weeks. LMP depends on patient’s memory and it assumes ovulation day is on 14±2 days, hence day of conception also varies.', 1, '2020-06-24 08:28:46', '2020-06-24 11:06:29'),
(58, 8, 2, 'Beta-hCG levels doubles in every 48 hours in viable pregnancy in first trimester. Condition associated with a poorly rising or declining hCG include all of the following except:', NULL, 'Twin pregnancy.', 'Ectopic pregnancy.', 'Anembryonic demise.', 'Missed abortion.', 'option1', 'Twin pregnancy is associated with an elevated beta-hCG.', 1, '2020-06-24 08:29:32', '2020-06-24 11:07:14'),
(59, 9, 2, 'Which of the following does the term trophoblast denote?', NULL, 'The extra embryonic peripheral cells of the blastocyst.', 'The gestational sac.', 'A rigid state of the flagellate microorganism.', 'it is the thickened endometrial wall.', 'option1', 'Trophoblast is the extra embryonic peripheral cells of the blastocyst, the future chorion. Once implanted in the uterine wall, starts secreting hCG. Placenta is also formed from the chorionic frondosum. It represents the inner wall of the double decidual ring of gestational sac.', 1, '2020-06-24 08:30:22', '2020-06-24 11:07:38'),
(60, 10, 2, 'The term decidua denotes the transformed endometrium of pregnancy. What are the different regions of the decidua in pregnancy?', NULL, 'Two regions namely, decidua basalis and chorionic villi.', 'Three regions- decidua basalis, decidual parietalis and decidua capsularis.', 'Three regins – endoderm, mesoderm and mesoderm.', 'amnion, chorion and extraembryonic coelom.', 'option2', 'The decidual of early intrauterine pregnancy is divided into decidua basalis, decidual parietalis (also called vera) and decidua capsularis. This marked hypertropic changes occurs in the endometrium and known as decidual reaction, no matter where the pregnancy is located.', 1, '2020-06-24 08:31:11', '2020-06-24 11:10:03'),
(61, 1, 3, 'info', NULL, '1', '2', '3', '4', 'option2', NULL, 1, '2021-01-25 07:34:20', '2021-01-25 07:34:20'),
(62, 2, 3, 'asxt', NULL, '1', '2', '4', '5', 'option1', NULL, 1, '2021-01-25 07:34:32', '2021-01-25 07:34:32'),
(63, 3, 3, 'xrtxty', NULL, '1', '2', '3', '4', 'option1', NULL, 1, '2021-01-25 07:34:47', '2021-01-25 07:34:47'),
(64, 1, 4, 'c++ online compiler', '1616397393.jpg', 'css', 'css3', 'html', 'html5', 'option2', 'C++ is a powerful general-purpose programming language. It can be used to develop operating systems, browsers, games, and so on. C++ supports different ways of programming like procedural, object-oriented, functional, and so on. This makes C++ powerful as well as flexible.\r\n\r\nOur C++ programming tutorial will guide you to learn C++ programming one step at a time.', 1, '2021-03-22 07:16:33', '2021-03-22 07:16:33'),
(65, 1, 5, '01. A patients presents for ultrasound exam at 14 weeks gestation with history of hyperemesis, is large for dates and has increased hCG levels. Ultrasound reveals a heterogeneous soft tissue mass within the endometrial cavity, with no evidence of fetus. Which of the following is the most likely cause of the findings?', NULL, 'A. Pseudogestational sac.', 'B. Hydatidiform mole.', 'C. Incomplete abortion.', 'D. Retained product of abortion.', 'option2', NULL, 1, '2021-03-23 06:09:13', '2021-03-23 06:09:13'),
(66, 1, 6, 'A patients presents for ultrasound exam at 14 weeks gestation with history of hyperemesis, is large for dates and has increased hCG levels. Ultrasound reveals a heterogeneous soft tissue mass within the endometrial cavity, with no evidence of fetus. Which of the following is the most likely cause of the findings?', NULL, 'Pseudogestational sac.', 'Hydatidiform mole.', 'Incomplete abortion.', 'Retained product of abortion.', 'option2', NULL, 1, '2021-03-23 06:26:12', '2021-03-23 06:26:12'),
(67, 2, 6, 'Hyperemesis is a common clinical finding associated with:', NULL, 'Ectopic pregnancy.', 'Embryonic demise.', 'Trophoblastic disease.', 'Heterotropic pregnancy.', 'option3', NULL, 1, '2021-03-23 06:32:34', '2021-03-23 06:32:34');
